    public void SetZoomSliderValues(float min, float max, float currentZoom)
    {
        ZoomSlider.onValueChanged.RemoveListener(delegate { OnZoomSliderValueChange(); });

        ZoomSlider.minValue = min;
        ZoomSlider.maxValue = max;
        ZoomSlider.value = currentZoom;

        ZoomSlider.onValueChanged.AddListener(delegate { OnZoomSliderValueChange(); });
    }

    public void OnZoomSliderValueChange()
    {
        if (_currentActiveMO != null)
        {
            _currentActiveMO.GameObject.transform.localScale = new Vector3(ZoomSlider.value, ZoomSlider.value, 0);

            _currentActiveMO.UGCFamily.UserZoomDelta = ZoomSlider.value;
        }
    }

    public IEnumerator<float> StopUGCVideos()
    {
        yield return 0;

        var movieObjectCount = _movieObjects.Values.Count();
        for (int i = 0; i < movieObjectCount; i++)
        {
            var movieObject = _movieObjects.Values.ElementAt(i);

            if (movieObject.MovieObjectType == MovieObjectType.Video && movieObject.VideoPlayer != null)
            {
                movieObject.VideoPlayer.Stop();

                movieObject.VideoPlayer.Prepare();

                yield return Timing.WaitUntilTrue(delegate { return CheckMovieObjectVideoPlayerState(movieObject); });

                movieObject.VideoPlayer.Pause();
            }
        }
    }

