    public void VideoFinishedCallback()
    {
        _currentFrame = _totalFrames;

        SetFrame(_currentFrame, false, false);

        //Trigger video Finished
#if !UNITY_EDITOR
                    if (RecorderManager.Instance.IsRecording())
                        CallbackHandler.OnSaving(100);
                    else
                    {
                        CallbackHandler.OnPlaying(100);
                        CallbackHandler.OnPlayCompleted();
                    }

#endif

        if (jsonMeta.useBackCover)
            SetBackCoverState(true);

        _isPlaying = false;
        StopPlaying();



        //PlaybackEngine.Instance.PlayPauseVideo();

#if UNITY_EDITOR
        SetRuntimeLabel();
#endif
        if(RecorderManager.Instance.IsRecording())
            RecorderManager.Instance.FinishRecord();

        PlaybackEngine.Instance.StopVideo();
    }


    public void SetFrame(int frame, bool isTransition, bool isPreload)
    {
        Timing.KillCoroutines(_transitionCoroutine);
        ScreenTransition.DOKill();

        if (isTransition)
        {
            //_transitionCoroutine = Timing.RunCoroutine(_TransitionToFrame(frame, isTransition, isPreload));
            TransitionToFrame(frame, isTransition, isPreload);
        }
        else
        {

            ScreenTransition.SetTransitioning(false);
            ScreenTransition.enabled = false;
            SetFrameInternal(frame, isPreload);
        }

        _transitionCount += isTransition ? 1 : 0;

        TriggerSetFrameReadyCallback();
    }

    public void SkipToFrame(int frame, bool isTransition, bool isPreload = false)
    {
        if (frame < 0 || frame > _totalFrames || _totalFrames == 0) return;

        if (_isBackCoverEnabled)
            SetBackCoverState(false);

        OnPauseAnimation();
        _currentFrame = frame;

        var frameTime = frame * (1f / 30f);
        SetFrame(frame, isTransition, isPreload);

        if (!isTransition)
        {
            ForegroundHandler.Instance.SetFrameVideoPlayer(frame + _videoFrameStart);
            PlaybackEngine.Instance.PauseAudio();
            PlaybackEngine.Instance.SetAudioTime(frameTime);
        }
    }

    public void SkipToFrameWithoutStop(int frame, bool isPreload = false)
    {
        if (frame < 0 || frame > _totalFrames || _totalFrames == 0) return;

        _currentFrame = frame;

        var frameTime = frame * (1f / 30f);
        ForegroundHandler.Instance.SetFrameVideoPlayer(frame + _videoFrameStart);
        PlaybackEngine.Instance.SetAudioTime(frameTime);
        PlaybackEngine.Instance.PlayAudio();

        SetFrame(frame, false, isPreload);
        OnResumeAnimation();
    }

    private void SetFrameInternal(int frame, bool isPreload)
    {
        var progress = (int)(((float)frame / _totalFrames) * 100);

#if !UNITY_EDITOR
        //We call the callback only when its the first 1% of the video and the playbacks its enabled (and we dont send the same progress value two times)
        if(!isPreload /*&& (PlaybackCallbacks || progress == 1) && progress > _lastProgressCalculation*/)
        {
            if (RecorderManager.Instance.IsRecording())
                CallbackHandler.OnSaving(progress);
            else
                CallbackHandler.OnPlaying(progress);

            _lastProgressCalculation = progress;
        }
#endif

        CheckIfVideoSavingItsStuck(progress);

        if (_isCoverEnabled && frame > 10)
        {
            SetCoverState(false);
        }
        else if (!_isCoverEnabled && frame < 10)
        {
            Debug.Log("Cover is not enabled and the frame is below 10");
        }

        var movieObjectCount = _movieObjects.Values.Count();
        for (int i = 0; i < movieObjectCount; i++)
        {
            var movieObject = _movieObjects.Values.ElementAt(i);
            if (frame < movieObject.FrameInPoint || frame > movieObject.FrameOutPoint)
            {
                movieObject.GameObject.SetActive(false);

                movieObject.GameObject.transform.parent.gameObject.SetActive(false);

                //if(movieObject.FrameInPoint - frame == 30)
                //{
                //    movieObject.VideoPlayer.Play();

                //    Timing.RunCoroutine(PauseAndPlayUGC(movieObject));
                //}
            }
            else
            {
                _currentActiveMO = movieObject;

                movieObject.GameObject.SetActive(true);

                if (movieObject.ugcPositionBasedOnVideo == UGCPositionType.Front)
                {
                    movieObject.GameObject.transform.parent.gameObject.SetActive(true);

                    _currentTemplateData.UGCDragFrontHandler.SetMaskGO(movieObject.MaskGO, movieObject);
                    _currentTemplateData.UGCDragFrontHandler.SetUGCId(movieObject.Name);
                    _currentTemplateData.UGCPinchFrontHandler.SetGameObjectToScale(movieObject.GameObject, movieObject);

                    _currentTemplateData.UGCRootFront.gameObject.SetActive(true);
                }
                else
                {
                    movieObject.GameObject.transform.parent.gameObject.SetActive(true);

                    _currentTemplateData.UGCDragBackHandler.SetMaskGO(movieObject.MaskGO, movieObject);
                    _currentTemplateData.UGCDragBackHandler.SetUGCId(movieObject.Name);
                    _currentTemplateData.UGCPinchBackHandler.SetGameObjectToScale(movieObject.GameObject, movieObject);

                    _currentTemplateData.UGCRootFront.gameObject.SetActive(false);
                }

                if(movieObject.MovieObjectType == MovieObjectType.Video)
                {
                    if(!movieObject.VideoPlayer.isPlaying && PlaybackEngine.Instance.IsPlaying())
                    {
                        movieObject.VideoPlayer.Play();
                        //Timing.RunCoroutine(PauseAndPlayUGC(movieObject));
                    }
                }
            }

        }


        if (_animationFrames.ContainsKey(frame))
        {
            var frameAnimations = _animationFrames[frame].GroupBy(a => a.AnimatedObject);

            if (frameAnimations != null)
            {
                foreach (var group in frameAnimations)
                {
                    SetMovieObjectFramePose(group);
                }
            }
        }


