    private void CheckIfVideoSavingItsStuck(float progress)
    {
        if (RecorderManager.Instance.IsRecording())
        {
            //Force the finish record trigger if the progress its stuck in 99%
            if (progress >= 99)
            {
                _counterForceFinishRecord += Time.deltaTime;

                if (_counterForceFinishRecord == _amountToForceFinishRecord)
                {
                    _counterForceFinishRecord = 0;
                    _currentFrame = _totalFrames;

                    Debug.Log("Video Saving Finished Manually");
                }
            }
        }
    }

    private void SetMaskValues(MovieObject movieObject)
    {
        var movieObjectRectTransform = movieObject.GameObject.GetComponent<RectTransform>();
        var movieObjectParentRectTransform = movieObject.GameObject.transform.parent.GetComponent<RectTransform>();

        //Only ajust the mask and border values on the first height and width read
        if (!movieObject.HasMaskBeenApplied)
        {
            // Ajust the transform values according to the UGC
            movieObjectParentRectTransform.anchorMin = movieObjectRectTransform.anchorMin;
            movieObjectParentRectTransform.anchorMax = movieObjectRectTransform.anchorMax;
            movieObjectParentRectTransform.anchoredPosition = movieObjectRectTransform.anchoredPosition;
            movieObjectParentRectTransform.sizeDelta = movieObjectRectTransform.sizeDelta;

            // Ajust the border transform values according to the UGC
            var borderRectTransform = movieObject.BorderGO.GetComponent<RectTransform>();
            borderRectTransform.anchorMin = movieObjectRectTransform.anchorMin;
            borderRectTransform.anchorMax = movieObjectRectTransform.anchorMax;
            borderRectTransform.anchoredPosition = movieObjectRectTransform.anchoredPosition;
            borderRectTransform.sizeDelta = movieObjectRectTransform.sizeDelta;

            movieObject.UGCLimitHandler = movieObject.MaskGO.gameObject.AddComponent<UGCLimitHandler>();

            //SetMaskLimitPoints(movieObjectParentRectTransform, movieObject);

            movieObject.HasMaskBeenApplied = true;

            AddBorderSideOnMaskAndUGC(movieObjectParentRectTransform, movieObjectRectTransform);
        }
    }

    private void AddBorderSideOnMaskAndUGC(RectTransform maskRectTransform, RectTransform movieObjectRectTransform)
    {
        maskRectTransform.sizeDelta = movieObjectRectTransform.sizeDelta * 1.01f;

        movieObjectRectTransform.sizeDelta = movieObjectRectTransform.sizeDelta * 1.01f;
    }

    private void SetCutoff()
    {
        ScreenTransition.SetCutoff(_cutoff);
    }

    private IEnumerator<float> _TransitionToFrame(int frame, bool isTransition, bool isPreload)
    {
        var delay = isTransition && _transitionCount > 0 ? 0.75f : 0f;
        Transform target = null;

        if (delay > 0)
        {
            target = GetActiveUGC();
            ScreenTransition.enabled = true;
            ScreenTransition.SetTransitioning(true);
            ScreenTransition.focus = target;
            ScreenTransition.SetCutoff(1.5f);
            DOTween.To(() => _cutoff, x => _cutoff = x, 2.5f, delay).OnUpdate(SetCutoff).OnComplete(() => FinalizeTransition(frame, isTransition, isPreload, delay));
        }

        yield return 0;
    }

    private void TransitionToFrame(int frame, bool isTransition, bool isPreload)
    {
        var delay = isTransition && _transitionCount > 0 ? 0.75f : 0f;
        Transform target = null;

        if (delay > 0)
        {
            target = GetActiveUGC();
            ScreenTransition.enabled = true;
            ScreenTransition.SetTransitioning(true);
            ScreenTransition.focus = target;
            ScreenTransition.SetCutoff(1.5f);
            DOTween.To(() => _cutoff, x => _cutoff = x, 2.5f, delay).OnUpdate(SetCutoff).OnComplete(() => FinalizeTransition(frame, isTransition, isPreload, delay));
        }
        else
        {
            if (_transitionCount == 0)
            {
                target = GetActiveUGC();
                ScreenTransition.enabled = true;
                ScreenTransition.SetTransitioning(true);
                ScreenTransition.focus = target;
                ScreenTransition.SetCutoff(2.5f);
                DOTween.To(() => _cutoff, x => _cutoff = x, 2.5f, delay).OnUpdate(SetCutoff).OnComplete(() => FinalizeTransition(frame, isTransition, isPreload, 0.5f));
            }

            FinalizeTransition(frame, isTransition, isPreload, delay);
        }
    }

    public void CloseTransitionEffect(int frame = 0)
    {
        if (_transitionCount == 0)
        {
            SetCoverState(true);

            Transform target = _currentTemplateData.PlaceholderImage.transform;
            ScreenTransition.enabled = true;
            ScreenTransition.SetTransitioning(true);
            ScreenTransition.focus = target;
            ScreenTransition.SetCutoff(2.5f);
            DOTween.To(() => _cutoff, x => _cutoff = x, 2.5f, 0f).OnUpdate(SetCutoff).OnComplete(() => FinalizeCloseTransitionEffect(frame, true, false, 0.3f, target));
        }
    }

    private void FinalizeCloseTransitionEffect(int frame, bool isTransition, bool isPreload, float delay, Transform _target)
    {
        _transitionCoroutine = Timing.RunCoroutine(_FinalizeCloseTransitionEffect(frame, isTransition, isPreload, delay, _target));
    }

    private IEnumerator<float> _FinalizeCloseTransitionEffect(int frame, bool isTransition, bool isPreload, float delay, Transform _target)
    {
        var frameTime = frame * (1f / 30f);

        PlaybackEngine.Instance.PauseAudio();
        PlaybackEngine.Instance.SetAudioTime(frameTime);

        SetFrameInternal(frame, isPreload);
        ForegroundHandler.Instance.SetFrameVideoPlayer(frame + _videoFrameStart);
        yield return Timing.WaitForSeconds(0.4f);

        if (delay > 0)
        {
            ScreenTransition.focus = _target;
            DOTween.To(() => _cutoff, x => _cutoff = x, 1.5f, delay).OnUpdate(SetCutoff).OnComplete(() => { ScreenTransition.SetTransitioning(false); ScreenTransition.enabled = true; }).SetEase(Ease.InCubic);
            yield return Timing.WaitForSeconds(delay);
        }
    }

    private void FinalizeTransition(int frame, bool isTransition, bool isPreload, float delay)
    {
        _transitionCoroutine = Timing.RunCoroutine(_FinalizeTransition(frame, isTransition, isPreload, delay));
    }

    private IEnumerator<float> _FinalizeTransition(int frame, bool isTransition, bool isPreload, float delay)
    {
        Transform target = null;
        var frameTime = frame * (1f / 30f);

        PlaybackEngine.Instance.PauseAudio();
        PlaybackEngine.Instance.SetAudioTime(frameTime);

        SetFrameInternal(frame, isPreload);
        ForegroundHandler.Instance.SetFrameVideoPlayer(frame + _videoFrameStart);
        yield return Timing.WaitForSeconds(0.4f);

        var activeUGC = SetFingerSignPosition();
        target = activeUGC;

#if UNITY_EDITOR
        SetHandState(true);
#endif

        if (delay > 0)
        {
            ScreenTransition.focus = target;
            DOTween.To(() => _cutoff, x => _cutoff = x, 1.5f, delay).OnUpdate(SetCutoff).OnComplete(() => { ScreenTransition.SetTransitioning(false); ScreenTransition.enabled = true; }).SetEase(Ease.InCubic);
            yield return Timing.WaitForSeconds(delay);
        }
    }

