    /// <summary>
    /// Read Video file for Unity VideoPlayer
    /// </summary>
    /// <param name="fileName"></param>
    /// <param name="player"></param>
    private void ReadVideoFile(string fileName, VideoPlayer player)
    {
        try
        {
            if (IsPcBuild)
            {
                var path = _animationPath;

                var directory = new DirectoryInfo(path);
                var filesInDirectory = directory.GetFiles();
                string videoName = filesInDirectory.FirstOrDefault(x => x.Name.Contains(".mp4")).Name;
                path = _animationPath + videoName;

                Debug.Log("Video file path - filename: " + path);
                player.url = path;
            }
            else
            {
                if (_dynamicTemplate)
                {
                    if(!_usingAddresables)
                    {
                        var path = string.Format("{0}{1}{2}.mp4", _appendPersistentPath ? string.Format("{0}/", Application.persistentDataPath) : string.Empty, _animationPath, fileName);

                        if (File.Exists(path))
                        {
                            Debug.Log("Video file path - filename: " + path);
                            player.url = path;

                            ForegroundHandler.Instance.SetVideoRenderMaterial(_currentTemplateData.ChromaMaterial);
                        }
                        else
                        {
                            path = string.Format("{0}{1}{2}.webm", _appendPersistentPath ? string.Format("{0}/", Application.persistentDataPath) : string.Empty, _animationPath, fileName);

                            Debug.Log("Video file path - filename: " + path);
                            player.url = path;

                            #if UNITY_IOS
                                ForegroundHandler.Instance.SetVideoRenderMaterial(null);
                            #elif UNITY_ANDROID
                             ForegroundHandler.Instance.SetVideoRenderMaterial(null);
                            #endif
                        }

                    }
                    else
                    {
                        player.clip = AddressablesManager.Instance.VideoClip;
                        ForegroundHandler.Instance.SetVideoRenderMaterial(null);
                    }

                }
                else
                {

                    //player.url = System.IO.Path.Combine(Application.streamingAssetsPath, "msc_ocean_cay_front/background.mp4");

#if UNITY_WEBGL
                player.url = System.IO.Path.Combine(Application.streamingAssetsPath, "GupShup_BollywoodBirthday_20210305/background.mp4");
#else

                    if (!_usingAddresables)
                    {
                        //var path = System.IO.Path.Combine(Application.streamingAssetsPath, _animationPath + "background.mp4");
                        var path = string.Format("{0}{1}.mp4", _animationPath, fileName);

                        if (File.Exists(path))
                        {
                            player.url = path;

                            ForegroundHandler.Instance.SetVideoRenderMaterial(_currentTemplateData.ChromaMaterial);
                        }
                        else
                        {
                            path = string.Format("{0}{1}.webm", _animationPath, fileName);

                            player.url = path;

                            #if UNITY_IOS
                                    ForegroundHandler.Instance.SetVideoRenderMaterial(null);
                            #elif UNITY_ANDROID
                                    ForegroundHandler.Instance.SetVideoRenderMaterial(null);
                            #endif
                        }
                    }
                    else
                    {
                        player.clip = AddressablesManager.Instance.VideoClip;
                        ForegroundHandler.Instance.SetVideoRenderMaterial(null);
                    }
#endif
                }
            }


            _audioSource = player.gameObject.AddComponent<AudioSource>();
            _audioSource.playOnAwake = false;
            _audioSource.volume = 0.5f;
            _audioSource.priority = 0;

            if (!_usingAddresables)
            {
                player.EnableAudioTrack(0, true);
                player.SetTargetAudioSource(0, _audioSource);
            }

            RecorderManager.Instance.AudioSource = _audioSource;
            PlaybackEngine.Instance.AudioSource = _audioSource;


#if (UNITY_IOS || UNITY_WEBGL) && !UNITY_EDITOR
            //string OutputMixer = "RecordingAudioMuted";
            //_audioSource.outputAudioMixerGroup = AudioMixer.FindMatchingGroups(OutputMixer)[0];

            //player.gameObject.AddComponent<AudioSourceRecorder>();
            //PlaybackEngine.Instance.StopAudio();
#endif

            StartCoroutine(ForegroundHandler.Instance.PrepareVideo());

            ForegroundHandler.Instance.SetVideoAsLoaded();
        }
        catch (Exception ex)
        {
            ErrorHandler.Instance.DebugError("Path not found or missing reference", "ReadVideoFile", ex.Message);
        }
    }


    private Sprite ReadUGCFile(string fileName)
    {
        Sprite spriteAsset;
        if (_dynamicTemplate)
        {
            spriteAsset = Resources.Load<Sprite>("ugc_placeholder");
        }
        else
        {
            spriteAsset = Resources.Load<Sprite>(string.Format("{0}{1}", _animationPath, fileName));

            if (spriteAsset == null)
            {
                var textureAsset = Resources.Load<Texture2D>(string.Format("{0}{1}", _animationPath, fileName));

                if (textureAsset != null)
                    spriteAsset = Sprite.Create(textureAsset, new Rect(0, 0, textureAsset.width, textureAsset.height), new Vector2(0.5f, 0.5f));
            }

            if (spriteAsset == null)
                spriteAsset = Resources.Load<Sprite>("ugc_placeholder");
        }
        return spriteAsset;
    }

