    private void CleanupOldTemplate()
    {
        if (_UGCImages == null) return;

        var ugcCount = _UGCImages.Values.Count();
        for (int i = 0; i < ugcCount; i++)
        {
            var existingUGC = _UGCImages.Values.ElementAt(i);

            if (existingUGC != null && existingUGC.Tex != null)
            {
                Destroy(existingUGC.Tex);
            }
        }
    }

    private IEnumerator<float> _ReadFileAsync()
    {

        yield return Timing.WaitForOneFrame;

        CleanupOldTemplate();
        MainAudioListener.enabled = false;
        AudioListener.volume = 0;

        _cutoff = 0;
        _cameras = new Dictionary<string, AECamera>();
        _UGCImages = new Dictionary<string, UGCObject>();

        _currCameraZoom = -Camera.main.transform.localPosition.z;
        _currCamera = Camera.main;

        _cameras.Add("-1", new AECamera { Camera = Camera.main, Zoom = _currCameraZoom, CameraIndex = -1, InPoint = 0, OutPoint = 10000000 });

        //Initialize internal structures
        _movieObjects = new Dictionary<string, MovieObject>();

        //Read the meta file
        _metaJson = ReadMetaFile();
     
        yield return Timing.WaitUntilTrue(delegate { return GetMetaJsonState(); });
        jsonMeta = JsonConvert.DeserializeObject<MetaObject>(_metaJson);

        //Once we have the path to the file, we bring it into memory as Raw Text
        _templateJson = ReadTemplateFile();

        yield return Timing.WaitUntilTrue(delegate { return GetTemplateJsonState(); });

        //Deserialize the JSON contents so we can have a nicely formated structure
        RawAEPJson jsonRaw = JsonConvert.DeserializeObject<RawAEPJson>(_templateJson);

        //Read the composition
        var compCount = jsonRaw.comps.Count();

        if (_usingAddresables)
        {
            LoadVideoFromAddressables();
            yield return Timing.WaitUntilTrue(delegate { return AddressablesManager.Instance.GetVideoClipStatus(); });
        }
           

        if (jsonRaw.comps[0].width > jsonRaw.comps[0].height)
        {
            _currentTemplateType = TemplateType.Landscape;
            _currentTemplateData = TemplateDataLandscape;

            TemplateDataLandscape.transform.parent.gameObject.SetActive(true);
            TemplateDataPortrait.transform.parent.gameObject.SetActive(false);
            TemplateDataSquare.transform.parent.gameObject.SetActive(false);
        }
        else if (jsonRaw.comps[0].width < jsonRaw.comps[0].height)
        {
            _currentTemplateType = TemplateType.Portrait;
            _currentTemplateData = TemplateDataPortrait;

            TemplateDataLandscape.transform.parent.gameObject.SetActive(false);
            TemplateDataPortrait.transform.parent.gameObject.SetActive(true);
            TemplateDataSquare.transform.parent.gameObject.SetActive(false);
        }
        else if (jsonRaw.comps[0].width == jsonRaw.comps[0].height)
        {
            _currentTemplateType = TemplateType.Square;
            _currentTemplateData = TemplateDataSquare;

            TemplateDataLandscape.transform.parent.gameObject.SetActive(false);
            TemplateDataPortrait.transform.parent.gameObject.SetActive(false);
            TemplateDataSquare.transform.parent.gameObject.SetActive(true);
        }

        _currentTemplateData.Width = (int)jsonRaw.comps[0].width;
        _currentTemplateData.Height = (int)jsonRaw.comps[0].height;

        _currentTemplateData.Canvas.sizeDelta = new Vector2(_currentTemplateData.Width, _currentTemplateData.Height);

        RecorderManager.Instance.SetCurrentTemplateType(_currentTemplateType, _currentTemplateData.MainCamera, _currentTemplateData.Width, _currentTemplateData.Height);
        PlaybackEngine.Instance.SetTemplateType(_currentTemplateType);
        RenderHandler.Instance.SetTemplateType(_currentTemplateType);

        ForegroundHandler.Instance.SetVideoPlayer(_currentTemplateData.ForegroundVideo, _currentTemplateData.ForegroundVideoRender);

        //Add the component for controlling the audio volume
#if UNITY_IOS && !UNITY_EDITOR
            if(_currentTemplateData.MainCamera.gameObject.GetComponent<AudioRecorderWithVolume>() == null)
            {
                var audioRecorderWithVolume = _currentTemplateData.MainCamera.gameObject.AddComponent<AudioRecorderWithVolume>();

                audioRecorderWithVolume.SetVolume(_generalVolume);
            }
#endif


        //_currentTemplateData.ChromaKey.keyColor = ChromaKeyColor();
        _currentTemplateData.ChromaMaterial.SetColor("_keyingColor", ChromaKeyColor());
        _currentTemplateData.LogoImage.enabled = IsLogoEnabled();

        for (int i = 0; i < compCount; i++) //We are not supporting multi-comp, so we break at the first one, but keep this code for the future
        {
            var comp = jsonRaw.comps[i];

            //_frameRate = (int)comp.frameRate;
            //Application.targetFrameRate = _frameRate;
            //_compSize = new Vector2(comp.width, comp.height);
            //_composition = comp;

            if (!string.IsNullOrEmpty(comp.workFrameDuration))
            {
                int.TryParse(comp.workFrameDuration, out _totalFrames);
            }
            _displayStartTime = comp.displayStartTime;

            break;
        }

        _videoFrameStart = (int)(_displayStartTime * _frameRate);

        //Using the JSON representation, create our MovieObjects and AnimationUnits
        //First, read bones. Each bone will become a GameObject

        var boneCount = jsonRaw.bones.Count();

        for (int i = 0; i < boneCount; i++)
        {
            var bone = jsonRaw.bones[i];
            //Each bone is a MovieObject. Create a new one.
            var newMO = new MovieObject
            {
                Animations = new List<AnimationUnit>()
            };

            if (bone.name == "background")
            {
                var attachmentName = bone.name; //The attachment is the name of the Resource we need to load
                ReadVideoFile(attachmentName, ForegroundHandler.Instance.GetVideoPlayer());

                continue;
            }
            else if (bone.name == "mask")
            {
                continue;
            }
            else if (bone.parent == "root")
            {
                var go = new GameObject
                {
                    name = bone.name
                };

                var newMORectTransform = go.AddComponent<RectTransform>();

                newMO.Name = bone.name;
                newMO.IsRoot = true;

                //TODO: use this scale and position?
                newMO.Scale = _currentTemplateData.UGCRootBack.transform.localScale;
                newMO.Position = _currentTemplateData.UGCRootBack.transform.position;
                //newMO.EulerRotation = UGCRoot.transform.rotation.eulerAngles;
                newMO.EulerOrientation = new Vector3(-bone.ox, bone.oy, -bone.oz);
                newMO.EulerRotation = new Vector3(bone.rx, bone.ry, -bone.rz);

                go.transform.SetParent(_currentTemplateData.UGCRootBack.transform);

                //Finally, assign the GameObject
                newMO.GameObject = go;
            }
            else
            {
                if (bone.parent == null)
                    continue;

                if (!_movieObjects.ContainsKey(bone.parent))
                    continue;

                var go = new GameObject
                {
                    name = bone.name,
                    layer = 10
                };
                go.AddComponent<RectTransform>();
                newMO.Name = go.name;

                var existingObject = _movieObjects[bone.parent];

                newMO.Position = _currentTemplateData.UGCRootBack.transform.position;
                newMO.Scale = new Vector3(1f, 1f, 1f);

                newMO.EulerRotation = new Vector3(bone.ox, bone.oy, -bone.oz);

                newMO.Parent = existingObject;

                if (bone.parent != "root")
                    go.transform.SetParent(existingObject.GameObject.transform);

                SetParentingData(go, newMO);

                //Finally, assign the GameObject
                newMO.GameObject = go;
            }

            newMO.LayerInPoint = bone.layerInPoint;
            newMO.LayerOutPoint = bone.layerOutPoint;

            int.TryParse(bone.frameInPoint, out newMO.FrameInPoint);
            int.TryParse(bone.frameOutPoint, out newMO.FrameOutPoint);

            newMO.LayerType = bone.layerType;
            newMO.LayerSpecificData = bone.layerSpecificData;

            if (newMO.Name.StartsWith("UGC"))
            {
                //Create an empty object to apply operations
#region Init Variables

                var parentDummyGo = new GameObject { name = bone.name + "_root", layer = 10 };
                var rectTransform = parentDummyGo.AddComponent<RectTransform>();

                var movementRootGO = new GameObject { name = bone.name + "_movementroot", layer = 10 };
                var rectTransformMovementRoot = movementRootGO.AddComponent<RectTransform>();

                newMO.MovementRootGO = movementRootGO;

                newMO.GameObject.transform.tag = "UGC";

#endregion

                //Set the values for the RectTransform Movement Root
#region MovementRoot

                rectTransformMovementRoot.anchoredPosition = _currentTemplateData.UGCRootFront.position;
                rectTransformMovementRoot.anchorMin = new Vector2(0, 0);
                rectTransformMovementRoot.anchorMax = new Vector2(1, 1);
                rectTransformMovementRoot.pivot = new Vector2(0.5f, 0.5f);
                rectTransformMovementRoot.sizeDelta = _currentTemplateData.UGCRootFront.rect.size;

#endregion

#region Set the UI size based on the template type

                if (_currentTemplateType == TemplateType.Portrait)
                {
                    rectTransformMovementRoot.sizeDelta = new Vector2(1080, 1920);
                }
                else if(_currentTemplateType == TemplateType.Square)
                {
                    rectTransformMovementRoot.sizeDelta = new Vector2(1080, 1080);
                }

#endregion

                //Set the parents
#region Parents

                rectTransformMovementRoot.transform.SetParent(_currentTemplateData.UGCRootFront.transform);
                rectTransform.transform.SetParent(rectTransformMovementRoot.transform);

                newMO.ugcPositionBasedOnVideo = UGCPositionType.Front;

                var parentFrontGO = new GameObject { name = bone.name + "_Mask", layer = 10 };
                var rectTransformFrontGO = parentFrontGO.AddComponent<RectTransform>();

#endregion

                //This is to avoid an artifact visual on "OnReadFile btn trigger" that show the squares mask for like 1 second
                rectTransformFrontGO.sizeDelta = Vector2.zero;

                //Add the image and mask component
#region Mask

                var parentFrontGOImage = parentFrontGO.AddComponent<Image>();
                parentFrontGO.AddComponent<Mask>();

                newMO.MaskGO = parentFrontGO;

#endregion

                //Disable the raycast Target and change the alpha color to 40
#region Raycast + Color

                parentFrontGOImage.raycastTarget = false;
                parentFrontGOImage.color = new Color(parentFrontGOImage.color.r, parentFrontGOImage.color.g, parentFrontGOImage.color.b, 0.15f);

#endregion

                //Set the new root parent
#region Set Parents

                parentFrontGO.transform.SetParent(parentDummyGo.transform);

                newMO.GameObject.transform.SetParent(rectTransformFrontGO.transform);

#endregion

                //Add the border
#region Border

                var border = new GameObject { name = "Border", layer = 10 };
                border.transform.SetParent(rectTransformFrontGO.transform);

                var borderImage = border.AddComponent<Image>();
                borderImage.sprite = BorderUGCFront;
                borderImage.raycastTarget = false;
                border.SetActive(false);

                newMO.BorderGO = border;

#endregion

                //Check if the ugc is back then change do some extra configuration
#region Back UGC Configuration

                if (!bone.isFront)
                {
                    rectTransformMovementRoot.transform.SetParent(_currentTemplateData.UGCRootBack.transform);

                    newMO.ugcPositionBasedOnVideo = UGCPositionType.Back;
                }

#endregion

                //Set the parent size
#region Set Parent sizes

                rectTransform.anchorMin = Vector2.zero;
                rectTransform.anchorMax = Vector2.one;
                rectTransform.sizeDelta = Vector2.zero;

#endregion

#region Define UGC Type

                newMO.MovieObjectType = MovieObjectType.Image;

                LoadUGCLayer(newMO, bone);

#endregion

            }
            else if (newMO.LayerType.Equals("Shape"))
            {
                //LoadShapeLayer(newMO, bone);
                //Create an empty object to apply operations
                var parentDummyGo = new GameObject { name = bone.name + "_root", layer = 10 };
                var rectTransform = parentDummyGo.AddComponent<RectTransform>();
                rectTransform.transform.SetParent(_currentTemplateData.UGCRootBack.transform);
                rectTransform.anchorMin = Vector2.zero;
                rectTransform.anchorMax = Vector2.one;
                rectTransform.sizeDelta = Vector2.zero;

                newMO.GameObject.transform.SetParent(parentDummyGo.transform);

                LoadUGCLayer(newMO, bone);
            }
            else if (newMO.LayerType.Equals("AV") || newMO.LayerType.Equals("Solid"))
            {
                LoadAVLayer(newMO, bone);
            }

            //Add the new MovieObjet to the collection
            _movieObjects.Add(newMO.Name, newMO);
        }

        //Check if there is linked movie objects
        SetLinkedMovieObjects();

        //Set the ugc families
        SetUGCFamilies();

        //Second, Read the slots, these are our Graphic Assets
        var slotCount = jsonRaw.slots.Count();

        for (int i = 0; i < slotCount; i++)
        {
            var slot = jsonRaw.slots[i];
            var slotBone = slot.bone; //Get the bone

            if (_movieObjects.ContainsKey(slotBone)) //Get the existing MovieObject
            {
                SetGameObjectBasedOnType(slot);
            }
        }

        //Third, Read the animations for the bones
        CreateAnimationFrames(jsonRaw);

        ReadCoverFile();
        ReadBackCoverFile();
        ReadLogoFile();
        FinishLoadingFile();

        //if (GlobalDeclarations.IsRunningAsAServer)
        //    CreateJobsFromSQS();

        if (GlobalDeclarations.EnableTestMode && _useUGCTestImages && !IsPcBuild)
        {
            Invoke("ReplaceUGCForTesting", 1f);
        }

        if (IsRunningAsAServer && _jobs.Count > 0)
            RunJob(_jobs[0]);


        _metaJson = String.Empty;
        _templateJson = String.Empty;
        //RenderHandler.Instance.InitFramesFiles();

        //RenderHandler.Instance.InitBuffer(0);

        //ReplaceUGCFromAndroidAppTest();
        //Invoke("ReplaceUGCFromAndroidAppTest", 1f);

        //AudioListener.volume = 1;
    }

