    public void SetLinkedMovieObjects()
    {
        foreach (var movieObject in _movieObjects)
        {
            if (movieObject.Key.Length >= 5)
            {
                //var keyFilter = movieObject.Key.Substring(0, 5);
                var keyFilter = movieObject.Key;
                if (movieObject.Key.Contains("_"))
                {
                    keyFilter = movieObject.Key.Split('_')[0];
                }

                var movieObjects = _movieObjects;
                //Only get the ugcs that have "L" from for example "UGC 1_L1" or the ones that have "UGC 1" that match perfectly because otherwise this will connect UGC 1 and UGC 11,12 etc
                var movieObjectsRelated = movieObjects.Where(x => ((x.Key.StartsWith(keyFilter) && x.Key.Length == keyFilter.Length) || x.Key.StartsWith(keyFilter) && x.Key.Contains("_")) && x.Key != movieObject.Key);

                _movieObjects[movieObject.Key].LinkedMovieObjects = new List<MovieObject>();

                foreach (var movieObjectRelated in movieObjectsRelated)
                {
                    _movieObjects[movieObject.Key].LinkedMovieObjects.Add(_movieObjects[movieObjectRelated.Key]);
                }
            }
        }
    }

    public void SetUGCFamilies()
    {
        foreach (var movieObject in _movieObjects)
        {
            //If the one of the linked ugcs has a family the join that family, otherwise create a new one
            if (movieObject.Value.LinkedMovieObjects.Count > 0)
            {
                foreach (var movieObjectLinked in movieObject.Value.LinkedMovieObjects)
                {
                    if (!movieObject.Value.HasUGCFamily)
                    {
                        if (movieObjectLinked.HasUGCFamily)
                        {
                            movieObjectLinked.UGCFamily.MovieObjects.Add(movieObject.Value);

                            movieObject.Value.UGCFamily = movieObjectLinked.UGCFamily;
                            movieObject.Value.HasUGCFamily = true;
                            movieObject.Value.UGCFamily.UserZoomDelta = 1;
                        }
                        else
                        {
                            CreateNewUGCFamily(movieObject.Value);
                        }

                    }
                }
            }
            else
            {
                CreateNewUGCFamily(movieObject.Value);
            }
        }
    }

    private void CreateNewUGCFamily(MovieObject movieObject)
    {
        var newUGCFamily = new UGCFamily();
        newUGCFamily.MovieObjects.Add(movieObject);

        _ugcFamilies.Add(newUGCFamily);

        movieObject.UGCFamily = newUGCFamily;
        movieObject.HasUGCFamily = true;
        movieObject.UGCFamily.UserZoomDelta = 1;
    }

