    public IEnumerator<float> _AdvanceToFirstFrame()
    {
        yield return Timing.WaitForSeconds(0.5f);
        PlaybackEngine.Instance.GoToFrame(1, false, true);
        yield return Timing.WaitForSeconds(0.1f);
        PlaybackEngine.Instance.GoToFrame(0, false, true);
        yield return Timing.WaitForSeconds(0.1f);

        if (EnableTestMode)
            SetCoverState(false);

        if (MainAudioListener != null)
            MainAudioListener.enabled = true;


#if !UNITY_EDITOR
        CallbackHandler.OnUnityReady(_totalFrames);
#endif
    }

