    private AnimationType GetAnimationType(string animType)
    {
        switch (animType)
        {
            case "scale":
                return AnimationType.Scale;
            case "translate":
                return AnimationType.Translation;
            case "xRotation":
                return AnimationType.XRotation;
            case "yRotation":
                return AnimationType.YRotation;
            case "zRotation":
                return AnimationType.ZRotation;
            case "rotation":
                return AnimationType.Rotation;
            case "orientation":
                return AnimationType.Orientation;
            case "zoom":
                return AnimationType.Zoom;
            default:
                return AnimationType.Unknown;
        }

    }

    private AnimationFrame ParseAnimationFrame(AnimationType animationType, MovieObject animatedObject, Dictionary<string, object> step)
    {
        try
        {
            var animationFrame
                = new AnimationFrame()
                {
                    AnimatedObject = animatedObject,
                    AnimationType = animationType,
                    Time = float.Parse(step["time"].ToString())
                };

            int.TryParse(step["k"].ToString(), out animationFrame.Frame);

            switch (animationType)
            {
                case AnimationType.Scale:
                    animationFrame.Value = new Vector3(float.Parse(step["x"].ToString()), float.Parse(step["y"].ToString()), float.Parse(step["z"].ToString()));
                    break;
                case AnimationType.Translation:
                    animationFrame.Value = new Vector3(float.Parse(step["x"].ToString()), float.Parse(step["y"].ToString()), float.Parse(step["z"].ToString()));
                    break;
                case AnimationType.XRotation:
                    animationFrame.Value = new Vector3(-float.Parse(step["x"].ToString()), 0, 0);
                    break;
                case AnimationType.YRotation:
                    animationFrame.Value = new Vector3(0, float.Parse(step["y"].ToString()), 0);
                    break;
                case AnimationType.ZRotation:
                    animationFrame.Value = new Vector3(0, 0, float.Parse(step["z"].ToString()));
                    break;
                case AnimationType.Rotation:
                    animationFrame.Value = new Vector3(float.Parse(step["x"].ToString()), float.Parse(step["y"].ToString()), float.Parse(step["z"].ToString()));
                    break;
                case AnimationType.Orientation:
                    animationFrame.Value = new Vector3(float.Parse(step["x"].ToString()), float.Parse(step["y"].ToString()), float.Parse(step["z"].ToString()));
                    break;
                case AnimationType.Zoom:
                    animationFrame.Value = new Vector3(0, 0, float.Parse(step["zoom"].ToString()));
                    break;
            }

            return animationFrame;
        }
        catch (Exception ex)
        {
#if UNITY_EDITOR
            ErrorHandler.Instance.DebugError("Parse Error", "ParseAnimationFrame", ex.Message);
#endif
            return null;
        }
    }

    private void CreateAnimationFrames(RawAEPJson jsonRaw)
    {
        //Third, Read the animations for the bones
        _animationFrames = new Dictionary<int, List<AnimationFrame>>();
        if (_totalFrames > 0)
        {
            for (int i = 0; i < _totalFrames; i++)
            {
                _animationFrames.Add(i, new List<AnimationFrame>());
            }
        }

        Dictionary<string, object> allAnimations = JsonConvert.DeserializeObject<Dictionary<string, object>>(
            JsonConvert.SerializeObject(jsonRaw.animations.animation["bones"]));

        var movieObjectCount = _movieObjects.Values.Count;
        for (int i = 0; i < movieObjectCount; i++)
        {
            var movieObject = _movieObjects.Values.ElementAt(i);
            var name = movieObject.Name;
            if (allAnimations.ContainsKey(name)) //Get the existing MovieObject
            {
                Dictionary<string, object> objectAnimations = JsonConvert.DeserializeObject<Dictionary<string, object>>(JsonConvert.SerializeObject(allAnimations[name])); //Get all the animations for this object

                var objAnimationsCount = objectAnimations.Keys.Count();
                for (int j = 0; j < objAnimationsCount; j++) //For each type of animation there's an array with steps
                {
                    var animType = objectAnimations.Keys.ElementAt(j);
                    Dictionary<string, object>[] animSteps =
                        JsonConvert.DeserializeObject<Dictionary<string, object>[]>(JsonConvert.SerializeObject(objectAnimations[animType]));

                    var animationType = GetAnimationType(animType);
                    var lastFrameProcessed = 0;
                    AnimationFrame lastFrame = null;

                    var stepCount = animSteps.Count();
                    for (int k = 0; k < stepCount; k++)
                    {
                        var step = animSteps[k];
                        var newFrame = ParseAnimationFrame(animationType, movieObject, step);

                        if (newFrame.Frame >= 0)
                        {
                            _animationFrames[newFrame.Frame].Add(newFrame); //Add the frame to that list

                            //If there's a gap, then fill that gap
                            if (newFrame.Frame > lastFrameProcessed + 1)
                            {
                                if (lastFrame == null)
                                    lastFrame = newFrame; //if frames didn't start from 0, then this will complete the gap with the first frame

                                for (int l = lastFrameProcessed + 1; l < newFrame.Frame; l++)
                                {
                                    _animationFrames[l].Add(lastFrame); //Add the frame to that list
                                }
                            }

                            lastFrame = newFrame;
                            lastFrameProcessed = newFrame.Frame;
                        }
                    }
                }
            }
        }
    }

    private void SetParentingData(GameObject go, MovieObject mo)
    {
        go.GetComponent<RectTransform>().anchoredPosition3D = new Vector3(0, 0, 0);
        go.GetComponent<RectTransform>().localScale = mo.Scale;
        go.GetComponent<RectTransform>().rotation = Quaternion.Euler(mo.EulerRotation + mo.EulerOrientation);
    }

    private void SetGameObjectBasedOnType(SlotElelement slot)
    {
        var slotBone = slot.bone; //Get the bone

        if (_movieObjects.ContainsKey(slotBone)) //Get the existing MovieObject
        {
            var existingObject = _movieObjects[slotBone];
            var layerType = existingObject.LayerType;

            switch (layerType)
            {
                case "AV":
                case "Shape":
                    SetAVLayerContent(slot, existingObject);
                    break;
                case "Text":
                    LoadTextLayer(slot, existingObject);
                    break;
                case "Audio":
                    LoadAudioLayer(slot, existingObject);
                    break;
                case "Video":
                    SetVideoLayerContent(slot, existingObject);
                    break;
            }
        }
    }

    private void LoadAudioLayer(SlotElelement slot, MovieObject existingObject)
    {
        var attachmentName = slot.name; //The attachment is the name of the Resource we need to load
        var audioAsset = Resources.Load<AudioClip>(string.Format("{0}{1}", _animationPath, attachmentName)); //TODO: For now, we read Sprites. https://docs.unity3d.com/ScriptReference/Resources.Load.html

        //Each Asset we read is going to be a new GameObject, child of the initial one.
        var newGO = new GameObject
        {
            name = slot.name
        };

        var audioLayer = newGO.AddComponent<AudioSource>();
        audioLayer.clip = audioAsset;

        newGO.transform.parent = existingObject.GameObject.transform; //The parent is the Bone's root.
    }

    private void LoadTextLayer(SlotElelement slot, MovieObject existingObject)
    {
        var layerData = existingObject.LayerSpecificData;

        //Each Asset we read is going to be a new GameObject, child of the initial one.
        var newGO = new GameObject
        {
            name = slot.name
        };

        var textLayer = newGO.AddComponent<Text>();
        textLayer.text = layerData["text"].ToString();
        //textLayer.fontSize = float.Parse(layerData["fontSize"].ToString());
        //textLayer.enableWordWrapping = false;

        newGO.transform.parent = existingObject.GameObject.transform; //The parent is the Bone's root.

        var rectTransform = newGO.GetComponent<RectTransform>();

        //Set anchor data
        rectTransform.anchorMin = new Vector2(0, 0);
        rectTransform.anchorMax = new Vector2(1, 1);
        rectTransform.offsetMin = rectTransform.offsetMax = new Vector2(0, 0);
        rectTransform.anchoredPosition3D = new Vector3(0, 0, 0); //TODO: play with anchors?
    }

    private void LoadShapeLayer(MovieObject existingObject, BoneElement bone)
    {
        //Set anchor data for the Shape Layer
        var height = float.Parse(bone.sourceRects["height"].ToString());
        var width = float.Parse(bone.sourceRects["width"].ToString());

        var yDelta = 0; //TODO: anchors for shape coming in 0 and they break the calculation. Add to JSON if needed
        var xDelta = 0;

        var shapeLayerTransform = existingObject.GameObject.GetComponent<RectTransform>();

        if (bone.parent == "root")
        {
            //DO SOMETHING?
        }
        else
        {
            var relPosition = TranslateAEPositionToWorld(new Vector3(bone.x, bone.y, bone.z), existingObject.Parent.GameObject.transform.GetComponent<RectTransform>());
            shapeLayerTransform.anchoredPosition3D = new Vector3(relPosition.x + xDelta, relPosition.y - yDelta, bone.z);
        }

        shapeLayerTransform.sizeDelta = new Vector2(width, height);
        shapeLayerTransform.localScale = new Vector3(bone.scaleX, bone.scaleY, bone.scaleZ);

        //Create a mask and set the position relative to the Shape Layer
        var imageMaskGO = new GameObject() { name = "mask" };
        imageMaskGO.transform.parent = existingObject.GameObject.transform; //The parent is the Shape Layer Root
        existingObject.UIImage = imageMaskGO.AddComponent<Image>();
        existingObject.UIImage.enabled = true;

        imageMaskGO.AddComponent<RectMask2D>();

        width = 0;
        height = 0;
        float x = 0;
        float y = 0;

        if (bone.contents != null)
        {
            width = bone.contents["rectSize"][0];
            height = bone.contents["rectSize"][1];
            x = bone.contents["rectPosition"][0];
            y = bone.contents["rectPosition"][1];
        }

        var maskRectTransform = imageMaskGO.GetComponent<RectTransform>();
        maskRectTransform.anchoredPosition3D = new Vector3(x, -y, 0);
        maskRectTransform.sizeDelta = new Vector2(width, height);
        maskRectTransform.localScale = new Vector3(1, 1, 1);
    }

    private void LoadUGCLayer(MovieObject existingObject, BoneElement bone)
    {
        var newGO = existingObject.GameObject;

        existingObject.UIImage = newGO.AddComponent<Image>();
        existingObject.UIImage.enabled = true;
        existingObject.UIImage.preserveAspect = false;

        var parentTransform = existingObject.GameObject.GetComponent<RectTransform>();

        var height = float.Parse(bone.sourceRects["height"].ToString());
        var width = float.Parse(bone.sourceRects["width"].ToString());

        parentTransform.sizeDelta = new Vector2(width, height); //This is the full image size. Would need a way to recognize the mask
        var relPosition = TranslateAEPositionToWorld(new Vector3(bone.x, bone.y, bone.z), existingObject.GameObject.GetComponent<RectTransform>());

        parentTransform.localScale = new Vector3(bone.scaleX, bone.scaleY, bone.scaleZ);
        parentTransform.localEulerAngles = new Vector3(bone.ox, bone.oy, -bone.oz);

        parentTransform.anchoredPosition3D = new Vector3(relPosition.x, relPosition.y, bone.z);

        //existingObject.LocalInitScale = parentTransform.localScale;
        //existingObject.LocalInitOrientation = parentTransform.localEulerAngles;

        if (existingObject.ugcPositionBasedOnVideo == UGCPositionType.Back)
        {
            //var movieObjectRectTransform = existingObject.GameObject.GetComponent<RectTransform>();
            //movieObjectRectTransform.sizeDelta = new Vector2(movieObjectRectTransform.sizeDelta.x + (movieObjectRectTransform.sizeDelta.x * 1.2f), movieObjectRectTransform.sizeDelta.y + (movieObjectRectTransform.sizeDelta.y * 1.2f));

            existingObject.LocalInitScale = Vector3.one; /** 1.2f;*/
        }
        else
        {
            existingObject.LocalInitScale = Vector3.one;
        }


        existingObject.LocalInitOrientation = Quaternion.identity.eulerAngles;

        existingObject.GameObject.transform.localScale = existingObject.LocalInitScale;
        existingObject.GameObject.transform.rotation = Quaternion.identity;
        existingObject.GameObject.transform.position = Vector3.zero;
    }

    private void LoadUGCVideoLayer(MovieObject existingObject, BoneElement bone)
    {
        var newGO = existingObject.GameObject;

        existingObject.VideoPlayer = newGO.AddComponent<VideoPlayer>();
