    private void LoadAVLayer(MovieObject existingObject, BoneElement bone)
    {
        if (bone.parent == "root") return;

        //Each Asset we read is going to be a new GameObject, child of the initial one.
        var newGO = new GameObject
        {
            name = bone.name,
            layer = 10
        };

        existingObject.UIImage = newGO.AddComponent<Image>();
        existingObject.UIImage.enabled = false;

        var parentTransform = existingObject.GameObject.GetComponent<RectTransform>();
        var rectTransform = newGO.GetComponent<RectTransform>();

        //Set anchor data
        var height = float.Parse(bone.sourceRects["height"].ToString());
        var width = float.Parse(bone.sourceRects["width"].ToString());

        //Calculate anchor
        var anchorY = bone.anchorPointArray[1];
        var anchorX = bone.anchorPointArray[0];

        var yDelta = (height / 2) - anchorY;
        var xDelta = (width / 2) - anchorX;

        //If the parent is not the root and it's a Shape, we need to create a mask
        if (existingObject.Parent.LayerType.Equals("Shape"))
        {
            var rectMask = existingObject.Parent.UIImage.GetComponent<RectMask2D>();
            newGO.transform.SetParent(rectMask.transform);

            rectTransform.sizeDelta = new Vector2(width, height);
            rectTransform.anchoredPosition3D = new Vector3(0 + xDelta, 0 - yDelta, 0);
        }
        else
        {
            rectTransform.sizeDelta = new Vector2(width, height);
            parentTransform.sizeDelta = new Vector2(width, height);

            var relPosition = TranslateAEPositionToWorld(new Vector3(bone.x, bone.y, bone.z), existingObject.GameObject.GetComponent<RectTransform>());
            parentTransform.anchoredPosition3D = new Vector3(relPosition.x + xDelta, relPosition.y - yDelta, bone.z);

            newGO.transform.SetParent(existingObject.GameObject.transform); //The parent is the Bone's root.
            rectTransform.anchoredPosition3D = new Vector3(0, 0, 0);
            rectTransform.localScale = Vector3.one;
            newGO.transform.localRotation = Quaternion.identity;
        }

        parentTransform.localScale = new Vector3(bone.scaleX, bone.scaleY, bone.scaleZ);
    }

    private void LoadLightLayer(MovieObject existingObject, BoneElement bone)
    {
        //Each Asset we read is going to be a new GameObject, child of the initial one.
        var newGO = new GameObject
        {
            name = bone.name
        };

        //Calculate anchor
        var anchorY = bone.anchorPointArray[1];
        var anchorX = bone.anchorPointArray[0];

        var yDelta = anchorY;
        var xDelta = anchorX;

        if (bone.parent == "root")
        {
            var lightPosition = TranslateAEPositionToWorld(new Vector3(bone.x /*+ xDelta*/, bone.y /*- yDelta*/, bone.z), null);
            var light = newGO.AddComponent<Light>();
            light.type = LightType.Directional;
            light.shadows = LightShadows.Soft;
            light.intensity = bone.lightIntensity;
            light.color = new Color(bone.lightColor[0], bone.lightColor[1], bone.lightColor[2], bone.lightColor[3]);
            light.spotAngle = bone.lightConeAngle;
            light.transform.position = lightPosition;
            existingObject.GameObject = newGO;
            existingObject.Light = light;
        }
    }

