    public Vector3 TranslateAEPositionToWorld(Vector3 original, Transform parentTransform)
    {
        RectTransform parent = null;
        var ratio = GetScreenToWorldRatio();
        float xDelta; float yDelta; float zDelta;

        if (parentTransform != null)
        {
            parent = parentTransform.GetComponent<RectTransform>();
        }

        //AE starts at (0,0) Top-left corner, Unity starts at (0,0) in the center, Top-left corner is (-width/2, height/2). We calculate the delta to translate the positions.
        if (parent != null)
        {
            xDelta = -parent.rect.width / 2;
            yDelta = -parent.rect.height / 2;
            zDelta = 0;  //parent.transform.position.z; //TODO: z-index magic, for now we just place right in front on the plane, our Z zero
        }
        else
        {
            xDelta = -_compSize.x / 2;
            yDelta = -_compSize.y / 2;
            zDelta = -_currCameraZoom; //TODO: z-index magic, for now we just place right in front on the plane, our Z zero
        }

        var newPos = new Vector3((original.x + xDelta) * ratio.x,
                                 -(original.y + yDelta) * ratio.y,
                                  (original.z + zDelta) * ratio.z);

        return newPos;
    }

    private Vector3 GetScreenToWorldRatio()
    {
        //TODO: Assuming a hardcoded ratio
        var xRatio = 1;
        var yRatio = 1;
        var zRatio = 1;

        return new Vector3(xRatio, yRatio, zRatio);
    }

