    private void SetMovieObjectFramePose(IGrouping<MovieObject, AnimationFrame> frameGroup)
    {
        var movieObject = frameGroup.Key;
        if (!movieObject.GameObject.activeSelf) return; //If it's not currently active, then abort animating

        var movieObjectRectTransform = movieObject.GameObject.transform.parent.transform.parent.GetComponent<RectTransform>();

        movieObjectRectTransform.localEulerAngles = Vector3.zero;

        Vector3 initialOrientation = movieObject.EulerOrientation;
        Vector3 initialRotation = movieObject.EulerRotation;

        bool overridesOrientation = false;
        bool overridesRotation = false;
        bool overridesRotationX = false;
        bool overridesRotationY = false;
        bool overridesRotationZ = false;

        Vector3 calcRotation;

        foreach (var animationFrame in frameGroup)
        {
            //Debug.Log(animationFrame.AnimationType);

            switch (animationFrame.AnimationType)
            {
                case AnimationType.Scale:
                    var finalScale = new Vector3(animationFrame.Value.x, animationFrame.Value.y, animationFrame.Value.z);
                    movieObjectRectTransform.localScale = finalScale;
                    break;
                case AnimationType.Translation:
                    var finalPosition = TranslateAEPositionToWorld(new Vector3(animationFrame.Value.x, animationFrame.Value.y, animationFrame.Value.z), movieObject.GameObject.transform.parent.transform.parent);
                    movieObjectRectTransform.localPosition = finalPosition;

                    break;
                case AnimationType.XRotation:
                    calcRotation = new Vector3(animationFrame.Value.x, 0, 0);
                    movieObjectRectTransform.localEulerAngles += calcRotation;
                    overridesRotationX = true;

                    //Debug.Log("Rotation X");
                    break;
                case AnimationType.YRotation:
                    calcRotation = new Vector3(animationFrame.Value.x, animationFrame.Value.y, -animationFrame.Value.z);
                    movieObjectRectTransform.localEulerAngles += calcRotation;
                    overridesRotationY = true;

                    //Debug.Log("Rotation Y");
                    break;
                case AnimationType.ZRotation:
                    calcRotation = new Vector3(animationFrame.Value.x, animationFrame.Value.y, -animationFrame.Value.z);
                    movieObjectRectTransform.localEulerAngles += calcRotation;
                    overridesRotationZ = true;

                    //Debug.Log("Rotation Z");
                    break;
                case AnimationType.Rotation:
                    calcRotation = new Vector3(animationFrame.Value.x, animationFrame.Value.y, -animationFrame.Value.z);
                    movieObjectRectTransform.localEulerAngles += calcRotation;
                    overridesRotation = true;

                    //Debug.Log("Rotation X: " + calcRotation.x + " Rotation Y:" + calcRotation.y + "Rotation Z: " + calcRotation.z);
                    break;
                case AnimationType.Orientation:
                    calcRotation = new Vector3(-animationFrame.Value.x, animationFrame.Value.y, -animationFrame.Value.z);
                    movieObjectRectTransform.localEulerAngles += calcRotation;
                    overridesOrientation = true;

                    //Debug.Log("Orientation X: " + calcRotation.x + " Orientation Y:" + calcRotation.y + "Orientation Z: " + calcRotation.z);
                    break;
                case AnimationType.Zoom:
                    break;
            }
        }

        if (!overridesOrientation)
            movieObjectRectTransform.localEulerAngles += initialOrientation;

        if (!overridesRotation && !overridesRotationX)
        {
            movieObjectRectTransform.localEulerAngles += new Vector3(initialRotation.x, 0, 0);
        }

        if (!overridesRotation && !overridesRotationY)
        {
            movieObjectRectTransform.localEulerAngles += new Vector3(0, initialRotation.y, 0);
        }

        if (!overridesRotation && !overridesRotationZ)
        {
            movieObjectRectTransform.localEulerAngles += new Vector3(0, 0, initialRotation.z);
        }



        if (!movieObject.HasMaskBeenApplied)
            SetMaskValues(movieObject);

        //if (!movieObject.HasScaleBeenApplied)
        //    ApplyUGCInitalScale(movieObject);

#if !UNITY_WEBGL
         UpdateUGCScaleAndMovement(movieObject);
#endif
    }


    private void SetFramePose(AnimationFrame animationFrame)
    {
        var movieObject = animationFrame.AnimatedObject;
        if (!movieObject.GameObject.activeSelf) return; //If it's not currently active, then abort animating

        var movieObjectRectTransform = movieObject.GameObject.transform.parent.GetComponent<RectTransform>();

        switch (animationFrame.AnimationType)
        {
            case AnimationType.Scale:
                var finalScale = new Vector3(animationFrame.Value.x, animationFrame.Value.y, animationFrame.Value.z);
                movieObjectRectTransform.localScale = finalScale;
                break;
            case AnimationType.Translation:
                var finalPosition = TranslateAEPositionToWorld(new Vector3(animationFrame.Value.x, animationFrame.Value.y, animationFrame.Value.z), movieObject.GameObject.transform.parent);
                movieObjectRectTransform.localPosition = finalPosition;
                break;
            case AnimationType.XRotation:
            case AnimationType.YRotation:
            case AnimationType.ZRotation:
                var finalRotation = new Vector3(animationFrame.Value.x, animationFrame.Value.y, -animationFrame.Value.z);
                movieObjectRectTransform.localEulerAngles = finalRotation;
                break;
            case AnimationType.Rotation:
                var fullRotation = new Vector3(animationFrame.Value.x, animationFrame.Value.y, -animationFrame.Value.z);
                movieObjectRectTransform.localEulerAngles = fullRotation;
                break;
            case AnimationType.Orientation:
                var finalOrientation = new Vector3(animationFrame.Value.x, animationFrame.Value.y, -animationFrame.Value.z);
                movieObjectRectTransform.localEulerAngles = finalOrientation;
                break;
            case AnimationType.Zoom:
                break;
        }
    }

