    public void OnPlayAnimation(CallbackSource callbackSource = CallbackSource.Internal)
    {
        Debug.Log("Playback Started - " + callbackSource);

        //Start Playing
        _isPlaying = true;
        _currentFrame = 0;

        if (_isBackCoverEnabled)
            SetBackCoverState(false);

        //Set the mask image alpha to 1
        UGCFrontMaskHandler(0.003f);
        BorderUGCHandler(false);

        ForegroundHandler.Instance.Play();

        StartPlaying();
    }

    public void OnResumeAnimation(CallbackSource callbackSource = CallbackSource.Internal)
    {
        Debug.Log("Playback Resumed - " + callbackSource);

        _isPlaying = true;

        //Set the mask image alpha to 1
        UGCFrontMaskHandler(0.003f);
        BorderUGCHandler(false);
        ForegroundHandler.Instance.Play();
        StartPlaying();
    }

