    public void OnPauseAnimation(CallbackSource callbackSource = CallbackSource.Internal)
    {
        Debug.Log("Playback Paused - " + callbackSource);

        _isPlaying = false;

        ForegroundHandler.Instance.Pause();

        if(_currentActiveMO != null && _currentActiveMO.MovieObjectType == MovieObjectType.Video)
            _currentActiveMO.VideoPlayer.Pause();

        UGCFrontMaskHandler(1f);
        BorderUGCHandler(true);

#if UNITY_WEBGL
        //SetZoomSliderState(true);
#endif

        PausePlaying();
    }


    public void OnStopAnimation()
    {
        Debug.Log("Playback Stoped");

        _isPlaying = false;
        _currentFrame = 0;
        _runTime = 0;

        StopPlaying();

        CloseTransitionEffect();

        //SetZoomSliderState(false);

        HideMovieObjects();

        //To avoid callbacks on pause after the video stop and doing set frame on video players when they were stopped, this was removed but left here just in case
        //SkipToFrame(0);

        //PlaceholderImage.transform.parent.gameObject.SetActive(true);
        _isCoverEnabled = true;

        if (_isBackCoverEnabled)
            SetBackCoverState(false);

        ForegroundHandler.Instance.Stop();

        //TODO: we are not restoring some initial scales apparently, verify
    }

    private void UGCFrontMaskHandler(float newAlpha)
    {
        if (_movieObjects != null)
        {
            foreach (var movieObject in _movieObjects)
            {
                if (_movieObjects[movieObject.Key].ugcPositionBasedOnVideo == UGCPositionType.Front)
                {
                    var parentMaskImage = _movieObjects[movieObject.Key].GameObject.transform.parent.gameObject.GetComponent<Image>();
                    parentMaskImage.color = new Color(parentMaskImage.color.a, parentMaskImage.color.g, parentMaskImage.color.b, newAlpha);
                }
            }
        }
    }

    private void BorderUGCHandler(bool newState)
    {
        foreach (var movieObject in _movieObjects)
        {
            if (_movieObjects[movieObject.Key].ugcPositionBasedOnVideo == UGCPositionType.Front)
            {
                _movieObjects[movieObject.Key].BorderGO.SetActive(newState);
            }
        }
    }

