    private Transform GetActiveUGC()
    {
        var keyCount = _UGCImages.Keys.Count;

        for (int i = 0; i < keyCount; i++)
        {
            var key = _UGCImages.Keys.ElementAt(i);

            if (_UGCImages[key].UGCImage != null && _UGCImages[key].UGCImage.IsActive())
            {
                return _UGCImages[key].UGCImage.transform;
            }
        }

        return null;
    }

