    public void InsertSticker(string path = "", string name = "")
    {

        if (!string.IsNullOrEmpty(path))
        {
            _stickerPath = path;
            _stickerName = name;
        }

        var sticker = new Sticker
        {
            GameObject = new GameObject { name = _stickerName },
            Parent = _currentTemplateData.StickerRoot.transform,
        };

        sticker.Name = sticker.GameObject.name;
        sticker.GameObject.transform.parent = sticker.Parent;
        sticker.GameObject.AddComponent<StickerDragHandler>();
        sticker.GameObject.AddComponent<StickerPinchHandler>();
        sticker.GameObject.AddComponent<UGCLimitHandler>();

        sticker.RawImage = sticker.GameObject.AddComponent<RawImage>();
        sticker.RawImage.texture = GetImageFromPath();
        sticker.RawImage.SetNativeSize();

        //Set Sticker Boundaries
        sticker.ScaleLimitMax = new Vector3(10, 10, 10);
        sticker.ScaleLimitMin = new Vector3(0.5f, 0.5f, 0.5f);

#if UNITY_EDITOR
        sticker.GameObject.GetComponent<RectTransform>().sizeDelta = new Vector2(200, 200);
#endif
        stickers.Add(sticker);
    }
    private void RemoveStickerFromScene(string id)
    {
        GetStickerFromId(id).GameObject.SetActive(false);
        stickers.Remove(GetStickerFromId(id));
    }

    public void SetStickersStatus(bool status)
    {
        if (stickers.Count < 1)
            return;

        for (int i = 0; i < stickers.Count; i++)
            stickers[i].GameObject.SetActive(status);
    }

    private Sticker GetStickerFromId(string id)
    {
        return stickers.Where(sticker => sticker.Name == id).SingleOrDefault();
    }

    private Texture2D GetImageFromPath()
    {
        Texture2D tex = null;
        byte[] fileData;
        string filePath = _stickerPath + _stickerName;

        if (File.Exists(filePath))
        {
            fileData = File.ReadAllBytes(filePath);
            tex = new Texture2D(2, 2);
            tex.LoadImage(fileData); //..this will auto-resize the texture dimensions.
        }
        return tex;
    }

