#region UGC Operations
    public void MoveUGCExternal(string imageId, int x, int y)
    {
        //if (_processingUGC) return;
        //_processingUGC = true;

        Timing.RunCoroutine(_MoveUGCInternal(imageId, x, y));
    }

    private IEnumerator<float> _MoveUGCInternal(string imageId, int x, int y)
    {
        yield return 0;

        var success = _UGCImages.TryGetValue(imageId, out UGCObject existingUGC);

        if (success)
        {
            var newPosition = existingUGC.UGCImage.transform.parent.transform.localPosition;
            newPosition.x += x;
            newPosition.y += y;
            existingUGC.UGCImage.transform.parent.transform.localPosition = newPosition;
            existingUGC.PosDelta = new Vector3(existingUGC.PosDelta.x + x, existingUGC.PosDelta.y + y, 0);
        }

        _processingUGC = false;
    }

    public void MoveUGCToNewPositionExternal(string imageId, float deltaX, float deltaY, float horizontalLimit, float verticalLimit)
    {
        Timing.RunCoroutine(_MoveUGCToNewPositionInternal(imageId, deltaX, deltaY, horizontalLimit, verticalLimit));
    }

    private IEnumerator<float> _MoveUGCToNewPositionInternal(string imageId, float deltaX, float deltaY, float horizontalLimit, float verticalLimit)
    {
        yield return 0;

        var success = _UGCImages.TryGetValue(imageId, out UGCObject existingUGC);

        if (success && existingUGC.UGCImage.type != Image.Type.Tiled)
        {
            var newPosition = existingUGC.UGCImage.transform.localPosition;
            newPosition.x += deltaX;
            newPosition.y += deltaY;

            //Apply limits based on the half width and height
            if (newPosition.x > horizontalLimit)
            {
                newPosition.x = horizontalLimit;
            }
            else if (newPosition.x < -horizontalLimit)
            {
                newPosition.x = -horizontalLimit;
            }

            if (newPosition.y > verticalLimit)
            {
                newPosition.y = verticalLimit;
            }
            else if (newPosition.y < -verticalLimit)
            {
                newPosition.y = -verticalLimit;
            }

            existingUGC.UGCImage.transform.localPosition = newPosition;
            existingUGC.PosDelta = new Vector3(existingUGC.PosDelta.x + deltaX, existingUGC.PosDelta.y + deltaY, 0);
        }
    }

    public void ScaleUGCExternal(string imageId, float scaleX, float scaleY)
    {
        //if (_processingUGC) return;
