    private IEnumerator<float> _ScaleUGCInternal(string imageId, float scaleX, float scaleY)
    {
        yield return 0;

        var success = _UGCImages.TryGetValue(imageId, out UGCObject existingUGC);

        if (success)
        {
            var newScale = new Vector3(existingUGC.Scale.x * scaleX, existingUGC.Scale.y * scaleY, 1);
            existingUGC.UGCImage.transform.localScale = newScale;
            existingUGC.ScaleDelta = new Vector3(scaleX, scaleY, 0);
        }

        _processingUGC = false;
    }

