    public void ReplaceUGCExternal(string imageId, string imageBase64)
    {
        //if (_processingUGC) return;
        //_processingUGC = true;

        if (!IsUGCBeingReplaced)
        {
            IsUGCBeingReplaced = true;

            Timing.RunCoroutine(_ReplaceUGCInternal(imageId, imageBase64));
        }
    }

    private IEnumerator<float> _ReplaceUGCInternal(string imageId, string imageBase64)
    {
        yield return 0;
        byte[] bytes = Convert.FromBase64String(imageBase64);

        var ugcList = _UGCImages.Where(x => (x.Key.StartsWith(imageId) && x.Key.Length == imageId.Length) || x.Key.StartsWith(imageId) && x.Key.Contains("_"));

        foreach (var ugc in ugcList)
        {
            var success = _UGCImages.TryGetValue(ugc.Key, out UGCObject existingUGC);

            if (success)
            {
                var movieObjectCountForMask = _movieObjects.Values.Count();
                for (int i = 0; i < movieObjectCountForMask; i++)
                {
                    var movieObject = _movieObjects.Values.ElementAt(i);

                    if (movieObject.Name == ugc.Key)
                    {
                        //Reset the components and value to be able to use a UGC image instead of video
                        if (movieObject.MovieObjectType != MovieObjectType.Image)
                        {
                            ResetUGCType(movieObject);
                        }

                        movieObject.MovementRootGO.transform.localPosition = Vector3.zero;

                        if (movieObject.GameObject.name == ugc.Key)
                        {
                            SetMaskValues(movieObject);
                        }
                    }
                }

                var tex = new Texture2D(2, 2);
                tex.LoadImage(bytes);

                var spriteAsset = Sprite.Create(tex, new Rect(0.0f, 0.0f, tex.width, tex.height), new Vector2(0f, 0f));

                if (spriteAsset != null)
                {
                    if (existingUGC.Tex != null)
                    {
                        DestroyImmediate(existingUGC.Tex);
                    }

                    existingUGC.UGCImage.sprite = spriteAsset;
                    existingUGC.Tex = tex;
                    existingUGC.UGCImage.type = Image.Type.Simple;
                    existingUGC.UGCImage.preserveAspect = true;
                    existingUGC.UGCImage.SetNativeSize();

                    //Reset the initial scale according to the ugc parent scale
                    var movieObjectCount = _movieObjects.Values.Count();
                    for (int i = 0; i < movieObjectCount; i++)
                    {
                        var movieObject = _movieObjects.Values.ElementAt(i);

                        if (movieObject.GameObject.name == ugc.Key)
                        {
                            movieObject.HasBeenReplaced = true;

                            movieObject.MovieObjectType = MovieObjectType.Image;

                            ResetMovieObjectValues(movieObject);

                            if (movieObject.GameObject.activeSelf)
                            {
                                SetMaskValues(movieObject);

                                UpdateUGCScaleAndMovement(movieObject);
                            }
                            else
                            {
                                movieObject.HasScaleBeenApplied = false;
                            }
                        }
                    }

                    CallbackHandler.OnImageReplaced();

                    SetFingerSignPosition();
                    //ShowFingerSign();
                }
            }

            ResetUGCExternal(imageId);

            _processingUGC = false;

            IsUGCBeingReplaced = false;

            CallbackHandler.OnSendMessage("Image replaced successfully");
            //Debug.Log("Image replaced successfully");
        }

        imageReplaced = false;
    }

    public void ReplaceUGCFromPathExternal(string imageId, string path)
    {
        //if (_processingUGC) return;
        //_processingUGC = true;

        if(!IsUGCBeingReplaced &&!imageReplaced)
        {
            IsUGCBeingReplaced = true;

            imageReplaced = true;

