    private IEnumerator<float> _ReplaceUGCVideoFromPathInternal(string imageId, string path)
    {
        yield return 0;

        CallbackHandler.OnSendMessage("Application.persistentDataPath path: " + Application.persistentDataPath);

        var ugcList = _UGCImages.Where(x => (x.Key.StartsWith(imageId) && x.Key.Length == imageId.Length) || x.Key.StartsWith(imageId) && x.Key.Contains("_"));

        foreach (var ugc in ugcList)
        {
            var success = _UGCImages.TryGetValue(ugc.Key, out UGCObject existingUGC);

            var fileFound = File.Exists(path);

            CallbackHandler.OnSendMessage("UGC Video found: " + success);
            CallbackHandler.OnSendMessage("File exists result: " + fileFound);

            //Load image from path and replace the ugc
            if (fileFound && success)
            {
                var videoSuccess = false;

                var movieObjectCountForMask = _movieObjects.Values.Count();
                for (int i = 0; i < movieObjectCountForMask; i++)
                {
                    var movieObject = _movieObjects.Values.ElementAt(i);

                    if (movieObject.Name == ugc.Key)
                    {
                        movieObject.MovementRootGO.transform.localPosition = Vector3.zero;

                        if (movieObject.GameObject.name == ugc.Key)
                        {
                            SetMaskValues(movieObject);
                        }

                        Timing.RunCoroutine(CreateUGCVideoPlayer(movieObject, path));

                        if(videoReplaced)
                            yield return Timing.WaitUntilTrue(delegate { return CheckMovieObjectVideoPlayerState(movieObject); });

                        //This means that the video player was created successfully because it has the video player component
                        if (movieObject.VideoPlayer != null)
                        {
                            videoSuccess = true;
                        }
                    }
                }

                if (videoSuccess)
                {
                    //Reset the initial scale according to the ugc parent scale
                    var movieObjectCount = _movieObjects.Values.Count();
                    for (int i = 0; i < movieObjectCount; i++)
                    {
                        var movieObject = _movieObjects.Values.ElementAt(i);

                        if (movieObject.Name == ugc.Key)
                        {
                            movieObject.HasBeenReplaced = true;

                            ResetMovieObjectValues(movieObject);

                            if (movieObject.GameObject.activeSelf)
                            {
                                if (movieObject.GameObject.name == ugc.Key)
                                {
                                    SetMaskValues(movieObject);
                                    if(videoReplaced)
                                        yield return Timing.WaitUntilTrue(delegate { return CheckMovieObjectVideoPlayerState(movieObject); });

                                    UpdateUGCScaleAndMovement(movieObject);
                                }
                            }
                            else
                            {
                                movieObject.HasScaleBeenApplied = false;
                            }
                        }
                    }

                    CallbackHandler.OnVideoReplaced();

                    SetFingerSignPosition();
                    //ShowFingerSign();
                }
            }

            ResetUGCExternal(imageId);

            _processingUGC = false;

            IsUGCBeingReplaced = false;

            videoReplaced = false;

            CallbackHandler.OnSendMessage("Video replaced successfully");
        }
    }

    private void ResetUGCType(MovieObject movieObject)
    {
        if (movieObject.RawImage != null)
        {
            movieObject.VideoPlayer.targetTexture = null;

            DestroyImmediate(movieObject.RawImage.texture);
        }

        if (movieObject.VideoAudioSource != null)
            DestroyImmediate(movieObject.VideoAudioSource);

        if (movieObject.VideoPlayer != null)
            DestroyImmediate(movieObject.VideoPlayer.gameObject);

        if (movieObject.RawImage != null)
            DestroyImmediate(movieObject.RawImage);

        if(movieObject.UIImage == null)
            movieObject.UIImage = movieObject.GameObject.AddComponent<Image>();

        //Update the image for this movieObject
        var imageId = movieObject.Name;

        var ugcList = _UGCImages.Where(x => (x.Key.StartsWith(imageId) && x.Key.Length == imageId.Length) || x.Key.StartsWith(imageId) && x.Key.Contains("_"));

        foreach (var ugc in ugcList)
        {
            var success = _UGCImages.TryGetValue(ugc.Key, out UGCObject existingUGC);

            if (success)
            {
                var movieObjectCount = _movieObjects.Values.Count();
                for (int i = 0; i < movieObjectCount; i++)
                {
                    var mo = _movieObjects.Values.ElementAt(i);

                    if (mo.Name == ugc.Key)
                    {
                        existingUGC.UGCImage = movieObject.UIImage;
                    }
                }
            }
        }

        imageReplaced = true;
    }

    private IEnumerator<float> CreateUGCVideoPlayer(MovieObject movieObject, string path)
    {
#region Add Video Player and disable UIImage

        if (movieObject.MovieObjectType != MovieObjectType.Video)
        {
            var newVideoPlayerGO = new GameObject(movieObject.Name);
            newVideoPlayerGO.transform.SetParent(_currentTemplateData.VideoPlayersTransform);

            movieObject.VideoPlayer = newVideoPlayerGO.AddComponent<VideoPlayer>();
        }

        if (movieObject.UIImage != null)
            movieObject.UIImage.enabled = false;

#endregion

#region Load the video and create the AudioSource

        //Load the video
        movieObject.VideoPlayer.source = VideoSource.Url;
        movieObject.VideoPlayer.playOnAwake = false;
        movieObject.VideoPlayer.waitForFirstFrame = false;
        movieObject.VideoPlayer.isLooping = true;
        movieObject.VideoPlayer.url = path;

        //Create the audio source and add the refence
        if (movieObject.VideoAudioSource == null)
            movieObject.VideoAudioSource = movieObject.VideoPlayer.gameObject.AddComponent<AudioSource>();

        movieObject.VideoAudioSource.playOnAwake = false;
        movieObject.VideoAudioSource.volume = 0.5f;
        movieObject.VideoAudioSource.priority = 0;
        movieObject.VideoAudioSource.mute = !_audioUGCVideoState;

        movieObject.VideoPlayer.audioOutputMode = VideoAudioOutputMode.AudioSource;
        movieObject.VideoPlayer.EnableAudioTrack(0, true);
        movieObject.VideoPlayer.SetTargetAudioSource(0, movieObject.VideoAudioSource);

#endregion

#region Enable the UGC to be able to prepare the videoplayer and render the texture

        var ugcState = movieObject.GameObject.activeSelf;

        if (!ugcState)
        {
            movieObject.MaskGO.SetActive(true);
            movieObject.GameObject.SetActive(true);
        }


      movieObject.VideoPlayer.Prepare();

      if(movieObject.VideoPlayer)
         yield return Timing.WaitUntilTrue(delegate { return CheckMovieObjectVideoPlayerState(movieObject); });

      movieObject.VideoPlayer.Play();



#endregion

#region Remove the UIImage and add the RawImage

        //Delete old image placeholder
        if (movieObject.UIImage != null)
            DestroyImmediate(movieObject.UIImage);

        //Create RawImage For Video Render
        if (movieObject.MovieObjectType != MovieObjectType.Video)
        {
            movieObject.RawImage = movieObject.GameObject.AddComponent<RawImage>();
        }
        else if(movieObject.RawImage != null && movieObject.RawImage.texture != null)
        {
            DestroyImmediate(movieObject.RawImage.texture);
        }

#endregion

#region Create the RenderTexture

        RenderTexture videoRenderTexture = new RenderTexture((int)movieObject.VideoPlayer.width, (int)movieObject.VideoPlayer.height, 24, RenderTextureFormat.Default);
        videoRenderTexture.Create();

        movieObject.RawImage.texture = videoRenderTexture;
        movieObject.VideoPlayer.targetTexture = videoRenderTexture;

#endregion

#region Wait for time so unity can render the texture on the RenderTexture

        //This is to simulate a WaitForSeconds but we can't use it here becuase the coroutine type doesnt match with the return of this method
        //The idea is to wait until the video player refresh the texture so it will be showing the frame 0/1 to the user
        if (movieObject.GameObject.activeSelf && movieObject.VideoPlayer)
        {
            yield return Timing.WaitForSeconds(0.1f);

            if(movieObject.VideoPlayer != null)
                movieObject.VideoPlayer.Pause();
        }


#endregion

#region Assaign UGC type and disable the UGC if it was disabled

        movieObject.MovieObjectType = MovieObjectType.Video;

        if (!ugcState)
        {
            movieObject.MaskGO.SetActive(false);
            movieObject.GameObject.SetActive(false);
        }

#endregion

        videoReplaced = true;
        //DebugText.text += " --- Video Replaced Complete";
    }

    private bool CheckMovieObjectVideoPlayerState(MovieObject movieObject)
    {
        return movieObject.VideoPlayer.isPrepared;
    }

    private void ResetMovieObjectValues(MovieObject movieObject)
    {
        if (movieObject.HasResizeToMatchFrameApplied)
        {
            //Reset the resize image
            var parentRoot = movieObject.GameObject.transform.parent;
            var parentRootRect = parentRoot.GetComponent<RectTransform>();
            var movieObjectRectTransform = movieObject.GameObject.GetComponent<RectTransform>();
            movieObjectRectTransform.sizeDelta = parentRootRect.sizeDelta;

            movieObject.HasResizeToMatchFrameApplied = false;
        }

        //Reset the scale
        movieObject.GameObject.transform.localScale = Vector3.one;
        movieObject.InitialScale = Vector3.one;
        movieObject.UGCFamily.UserZoomDelta = 0;

        //Reset the movement
        movieObject.GameObject.transform.localPosition = Vector3.zero;
        movieObject.UGCFamily.UserMovement = Vector3.zero;
    }

    public void SetAudioUGCVideoState(bool newState)
    {
        _audioUGCVideoState = newState;

        var movieObjectCount = _movieObjects.Values.Count();
        for (int i = 0; i < movieObjectCount; i++)
        {
            var movieObject = _movieObjects.Values.ElementAt(i);

            if(movieObject.MovieObjectType == MovieObjectType.Video && movieObject.VideoAudioSource != null)
            {
                movieObject.VideoAudioSource.mute = !_audioUGCVideoState;
            }
        }
    }

