#region UGC Movement - Scale - Reset - Limits

    private void UpdateUGCScaleAndMovement(MovieObject movieObject)
    {

        ResizeImageToMatchFrame(movieObject);

        //If the ugc world position its active, then use that for the initial scale, otherwise use family initial scale
        if (UseUGCWorldPosition)
        {
            SetUGCWorldPosition(movieObject);
        }
        else
        {
            SetUGCFamilyScale(movieObject);
        }

        //Set the scale limits after setting the initial scale
        SetUGCScaleLimits(movieObject);

        //Set the movement radius to apply the limits
        SetUGCMovementRadiusLimit(movieObject);

        //Add the user zoom
        AddUserZoomToMovieObject(movieObject);

        //Add the user movement
        AddUserMovementToMovieObject(movieObject);
    }

    private void ResizeImageToMatchFrame(MovieObject movieObject)
    {
        if (!movieObject.HasResizeToMatchFrameApplied && movieObject.HasBeenReplaced)
        {
            var parentRoot = movieObject.GameObject.transform.parent;
            var parentRootRect = parentRoot.GetComponent<RectTransform>();
            var movieObjectRectTransform = movieObject.GameObject.GetComponent<RectTransform>();
            var ugcWidth = 500;
            var ugcHeight = 500;

#region Old method that doesn't force the default size to be the minimum size (only when the image is smaller)

            ////If the image texture is small in width or height compared to the frame then resize otherwise dont apply any changes
            //if (imageWidth < parentRootRect.sizeDelta.x || imageHeight < parentRootRect.sizeDelta.y)
            //{
            //    //Set the size goal for the new size (for example if the image its 800x1000 we need to reach 1000 size and not 800)
            //    var parentSizeReference = parentRootRect.sizeDelta.x;

            //    if (parentRootRect.sizeDelta.y > parentRootRect.sizeDelta.x)
            //        parentSizeReference = parentRootRect.sizeDelta.y;

            //    //Check and get the minimum size of the image
            //    if (imageWidth < imageHeight)
            //    {
            //        var sizeMultipler = parentSizeReference / imageWidth;

            //        movieObjectRectTransform.sizeDelta = new Vector2(imageWidth * sizeMultipler, imageHeight * sizeMultipler);
            //    }
            //    else
            //    {
            //        var sizeMultipler = parentSizeReference / imageHeight;

            //        movieObjectRectTransform.sizeDelta = new Vector2(imageWidth * sizeMultipler, imageHeight * sizeMultipler);
            //    }
            //}

#endregion


            //Set the size goal for the new size (for example if the image its 800x1000 we need to reach 1000 size and not 800)
            var parentSizeReference = parentRootRect.sizeDelta.x;

            if(movieObject.MovieObjectType == MovieObjectType.Video && movieObject.VideoPlayer != null)
            {
                while (!movieObject.VideoPlayer.isPrepared && !movieObject.VideoPlayer.isPlaying)
                    return;

                ugcWidth = (int)movieObject.VideoPlayer.width;
                ugcHeight = (int)movieObject.VideoPlayer.height;
            }
            else if( movieObject.MovieObjectType == MovieObjectType.Image && movieObject.UIImage.sprite.texture != null)
            {
               ugcWidth = movieObject.UIImage.sprite.texture.width;
               ugcHeight = movieObject.UIImage.sprite.texture.height;
            }

            //Check and get the minimum size of the image
            if (ugcWidth < ugcHeight)
            {
                if (parentRootRect.sizeDelta.y > parentRootRect.sizeDelta.x)
                    parentSizeReference = parentRootRect.sizeDelta.y;

                var sizeMultipler = parentSizeReference / ugcWidth;

                movieObjectRectTransform.sizeDelta = new Vector2(ugcWidth * sizeMultipler, ugcHeight * sizeMultipler);
            }
            else
            {
                if (parentRootRect.sizeDelta.y > parentRootRect.sizeDelta.x)
                    parentSizeReference = parentRootRect.sizeDelta.y;

                var sizeMultipler = parentSizeReference / ugcHeight;

                movieObjectRectTransform.sizeDelta = new Vector2(ugcWidth * sizeMultipler, ugcHeight * sizeMultipler);
            }

            movieObject.HasResizeToMatchFrameApplied = true;

        }
    }

    private void SetUGCWorldPosition(MovieObject movieObject)
    {
#region ALL logic (this was when we didn't match the size of the image with the size of the mask, because of this we need to set scale to 1)

        ////if the root parent have a scale 0 (from the animation) then ignore this calculation
        //var parent = movieObject.GameObject.transform.parent.transform.parent;
        //if (parent.localScale.x == 0 || parent.localScale.y == 0)
        //    return;


        ////Get the world position based on the root parent
        //var newScaleForUGC = new Vector3(1 / parent.localScale.x, 1 / parent.localScale.y, 1 / parent.localScale.z);

        //movieObject.GameObject.transform.localScale = newScaleForUGC;
        //movieObject.InitialScale = newScaleForUGC;
        //movieObject.HasScaleBeenApplied = true;

#endregion

        if (movieObject.HasBeenReplaced)
        {
            //THIS IS HERE BECAUSE: they want that the image size match the mask width and height, so if the default size is that one we need to have the scale to 1 as a default too
            movieObject.GameObject.transform.localScale = Vector3.one;
            movieObject.InitialScale = Vector3.one;
            movieObject.HasScaleBeenApplied = true;
        }
        else
        {
            //if the root parent have a scale 0 (from the animation) then ignore this calculation
            var parent = movieObject.GameObject.transform.parent.transform.parent;
            if (parent.localScale.x == 0 || parent.localScale.y == 0)
                return;


            //Get the world position based on the root parent
            var newScaleForUGC = new Vector3(1 / parent.localScale.x, 1 / parent.localScale.y, 1 / parent.localScale.z);

            movieObject.GameObject.transform.localScale = newScaleForUGC;
            movieObject.InitialScale = newScaleForUGC;
        }
    }

    private void SetUGCFamilyScale(MovieObject movieObject)
    {
        //Set the family scale if there is not one already
        if (movieObject.UGCFamily.InitialScale == Vector3.zero || !movieObject.HasScaleBeenApplied)
        {
            SetUGCWorldPosition(movieObject);

            movieObject.UGCFamily.InitialScale = movieObject.InitialScale;
        }
        else
        {
            movieObject.GameObject.transform.localScale = movieObject.UGCFamily.InitialScale;
            movieObject.InitialScale = movieObject.UGCFamily.InitialScale;
            movieObject.HasScaleBeenApplied = true;
        }
    }

    private void SetUGCScaleLimits(MovieObject movieObject)
    {
        var maskParentRectTransform = movieObject.MaskGO.GetComponent<RectTransform>();
        var movieObjectRectTranform = movieObject.GameObject.GetComponent<RectTransform>();

        //The idea here it's to calculate the min scale based on the UGC size compare to the parent mask size, to be sure that the min scale match the width and height size of the mask parent
        //if the image is square then get the longest side of the parent mask to avoid bypass the limits

        if(movieObjectRectTranform.sizeDelta.x == movieObjectRectTranform.sizeDelta.y)
        {
            if(maskParentRectTransform.sizeDelta.x > maskParentRectTransform.sizeDelta.y)
            {
                movieObject.ScaleLimitMin = new Vector3(maskParentRectTransform.sizeDelta.x / movieObjectRectTranform.sizeDelta.x, maskParentRectTransform.sizeDelta.x / movieObjectRectTranform.sizeDelta.x, movieObject.InitialScale.z);
            }
            else
            {
                movieObject.ScaleLimitMin = new Vector3(maskParentRectTransform.sizeDelta.y / movieObjectRectTranform.sizeDelta.y, maskParentRectTransform.sizeDelta.y / movieObjectRectTranform.sizeDelta.y, movieObject.InitialScale.z);
            }
        }
        else if(movieObjectRectTranform.sizeDelta.x < movieObjectRectTranform.sizeDelta.y)
        {
            movieObject.ScaleLimitMin = new Vector3(maskParentRectTransform.sizeDelta.x / movieObjectRectTranform.sizeDelta.x, maskParentRectTransform.sizeDelta.x / movieObjectRectTranform.sizeDelta.x, movieObject.InitialScale.z);
        }
        else if(movieObjectRectTranform.sizeDelta.x > movieObjectRectTranform.sizeDelta.y)
        {
            movieObject.ScaleLimitMin = new Vector3(maskParentRectTransform.sizeDelta.y / movieObjectRectTranform.sizeDelta.y, maskParentRectTransform.sizeDelta.y / movieObjectRectTranform.sizeDelta.y, movieObject.InitialScale.z);
        }


        movieObject.ScaleLimitMax = new Vector3(movieObject.InitialScale.x * _ugcScaleLimitMultiplier, movieObject.InitialScale.y * _ugcScaleLimitMultiplier, movieObject.InitialScale.z * _ugcScaleLimitMultiplier);
    }

    private void SetUGCMovementRadiusLimit(MovieObject movieObject)
    {
        var ugcRectTransform = movieObject.GameObject.GetComponent<RectTransform>();

        movieObject.MovementRadiusLimit = new Vector3((ugcRectTransform.sizeDelta.x / 2) * movieObject.GameObject.transform.localScale.x,
                                                       (ugcRectTransform.sizeDelta.y / 2) * movieObject.GameObject.transform.localScale.y,
                                                        (ugcRectTransform.sizeDelta.y / 2) * movieObject.GameObject.transform.localScale.z);
    }

