    //This is method is called from the easy touch flow and we calculate the scale and movement of the ugc after the set pose, that is why we dont always add the delta to the total amount saved
    private void ScaleUGCInternal(MovieObject movieObject, float deltaPinch, bool addDeltaPinchTotalPinch, bool ignoreLimits)
    {
        //Multiply by 0.015f to reduce the scale sensitive
        var newScale = new Vector3(movieObject.GameObject.transform.localScale.x + deltaPinch * _ugcScaleSensitivity, movieObject.GameObject.transform.localScale.y + deltaPinch * _ugcScaleSensitivity, movieObject.GameObject.transform.localScale.z);

        if (!ignoreLimits)
        {
            newScale = new Vector3(Mathf.Clamp(newScale.x, movieObject.ScaleLimitMin.x, movieObject.ScaleLimitMax.x),
                                    Mathf.Clamp(newScale.y, movieObject.ScaleLimitMin.y, movieObject.ScaleLimitMax.x),
                                    Mathf.Clamp(newScale.z, movieObject.ScaleLimitMin.z, movieObject.ScaleLimitMax.x));
        }

        if (addDeltaPinchTotalPinch)
        {
            if (!ignoreLimits)
            {
                //Check if the new scale doesnt exceed the limits, otherwise we should not add the delta pinch
                if ((newScale.x > movieObject.ScaleLimitMin.x && newScale.x < movieObject.ScaleLimitMax.x) &&
                    (newScale.y > movieObject.ScaleLimitMin.y && newScale.y < movieObject.ScaleLimitMax.y))
                {
                    movieObject.UGCFamily.UserZoomDelta += deltaPinch;
                }
            }
            else
            {
                movieObject.UGCFamily.UserZoomDelta += deltaPinch;
            }
        }

        movieObject.GameObject.transform.localScale = new Vector3(newScale.x, newScale.y, newScale.z);
    }

