    public void ScaleStickerInternal(Sticker sticker, float deltaPinch, bool addDeltaPinchTotalPinch, bool ignoreLimits)
    {
        //Multiply by 0.015f to reduce the scale sensitive
        var newScale = new Vector3(sticker.GameObject.transform.localScale.x + deltaPinch * _ugcScaleSensitivity,
            sticker.GameObject.transform.localScale.y + deltaPinch * _ugcScaleSensitivity, sticker.GameObject.transform.localScale.z);


        if (newScale.x > sticker.ScaleLimitMax.x)
            newScale.x = sticker.ScaleLimitMax.x;

        if (newScale.x < sticker.ScaleLimitMin.x)
            newScale.x = sticker.ScaleLimitMin.x;

        if (newScale.y > sticker.ScaleLimitMax.y)
            newScale.y = sticker.ScaleLimitMax.y;

        if (newScale.y < sticker.ScaleLimitMin.y)
            newScale.y = sticker.ScaleLimitMin.y;

        sticker.GameObject.transform.localScale = new Vector3(newScale.x, newScale.y, newScale.z);
    }

