    public void MoveUGC(string ugcId, Vector3 deltaPosition)
    {
        var movieObject = _movieObjects[ugcId];

        MoveUGCInternal(movieObject, deltaPosition, true, false);
    }

    //This is method is called from the easy touch flow and we calculate the scale and movement of the ugc after the set pose, that is why we dont always add the delta to the total amount saved
    private void MoveUGCInternal(MovieObject movieObject, Vector3 deltaPosition, bool addDeltaMovementToTotalMomevent, bool ignoreLimits)
    {
        var ugcNewPosition = new Vector3(movieObject.GameObject.transform.localPosition.x + (deltaPosition.x * _ugcMovementSensitivity),
                                        movieObject.GameObject.transform.localPosition.y + (deltaPosition.y * _ugcMovementSensitivity),
                                        movieObject.GameObject.transform.localPosition.z);

        movieObject.GameObject.transform.localPosition = ugcNewPosition;

        if (addDeltaMovementToTotalMomevent)
        {
            if (!ignoreLimits)
            {
                var lastValidPosition = movieObject.UGCLimitHandler.GetLastValidPosition();

                var frameMaskRectTransform = movieObject.MaskGO.GetComponent<RectTransform>();
                var movieObjectRectTrasnform = movieObject.GameObject.GetComponent<RectTransform>();

                //Calculate the legal movement between the mask radius and the UGC radius
                float XLimit = (movieObjectRectTrasnform.sizeDelta.x / 2 * movieObject.GameObject.transform.localScale.x) - (frameMaskRectTransform.sizeDelta.x / 2);
                float YLimit = (movieObjectRectTrasnform.sizeDelta.y / 2 * movieObject.GameObject.transform.localScale.y) - (frameMaskRectTransform.sizeDelta.y / 2);

                //First check the X axie to allow some Y movement when the X reach the limit
#region X-Limit

                if (ugcNewPosition.x < XLimit && ugcNewPosition.x > -XLimit)
                {
                    movieObject.UGCFamily.UserMovement = new Vector3(movieObject.UGCFamily.UserMovement.x + deltaPosition.x, movieObject.UGCFamily.UserMovement.y, movieObject.UGCFamily.UserMovement.z);

                    lastValidPosition = new Vector3(ugcNewPosition.x, lastValidPosition.y, ugcNewPosition.z);
                }
                else
                {
                    lastValidPosition = new Vector3(Mathf.Clamp(lastValidPosition.x, -XLimit, XLimit),
                                        lastValidPosition.y,
                                        lastValidPosition.z);

                    movieObject.UGCLimitHandler.SetApplyLimitPositionState(true);
                }

#endregion

                //Same logic applied compare to X axie
#region Y-Limit

                if (ugcNewPosition.y < YLimit && ugcNewPosition.y > -YLimit)
                {
                    movieObject.UGCFamily.UserMovement = new Vector3(movieObject.UGCFamily.UserMovement.x, movieObject.UGCFamily.UserMovement.y + deltaPosition.y, movieObject.UGCFamily.UserMovement.z);

                    lastValidPosition = new Vector3(lastValidPosition.x, ugcNewPosition.y, ugcNewPosition.z);
                }
                else
                {
                    lastValidPosition = new Vector3(lastValidPosition.x,
                                        Mathf.Clamp(lastValidPosition.y, -YLimit, YLimit),
                                        lastValidPosition.z);

                    movieObject.UGCLimitHandler.SetApplyLimitPositionState(true);
                }

#endregion

                //Set the Last valid position for the ugc then OnDragUp on UGCDragHandler it will be applied the last valid position if it's need it
                movieObject.UGCLimitHandler.SetLastValidPosition(lastValidPosition);
            }
            else
            {
                //Add the two delta movements because we are ignoring the limits
                movieObject.UGCFamily.UserMovement = new Vector3(movieObject.UGCFamily.UserMovement.x + deltaPosition.x, movieObject.UGCFamily.UserMovement.y + deltaPosition.y, movieObject.UGCFamily.UserMovement.z);
            }
        }

    }

    public void MoveSticker(string stickerId, Vector3 deltaPosition)
    {
        var sticker = GetStickerFromId(stickerId);

