    public void MoveStickerInternal(GameObject movieObject, Vector3 deltaPosition, bool addDeltaMovementToTotalMomevent, bool ignoreLimits)
    {
        var ugcNewPosition = new Vector3(movieObject.transform.localPosition.x + (deltaPosition.x),
                                       movieObject.transform.localPosition.y + (deltaPosition.y),
                                       movieObject.transform.localPosition.z);

        movieObject.transform.localPosition = ugcNewPosition;

        var XLimite = _currentTemplateData.GetComponent<TemplateData>().ScreenSpaceUIRoot.sizeDelta.x;
        var YLimite = _currentTemplateData.GetComponent<TemplateData>().ScreenSpaceUIRoot.sizeDelta.y;

        if (movieObject.transform.position.x > XLimite / 2)
            movieObject.transform.position = new Vector2(XLimite / 2, ugcNewPosition.y);

        if (movieObject.transform.position.x < -XLimite / 2)
            movieObject.transform.position = new Vector2(-XLimite / 2, ugcNewPosition.y);


        if (movieObject.transform.position.y > YLimite / 2)
            movieObject.transform.position = new Vector2(ugcNewPosition.x, YLimite / 2);

        if (movieObject.transform.position.y < -YLimite / 2)
            movieObject.transform.position = new Vector2(ugcNewPosition.x, -YLimite / 2);

    }
    public void RecalculateUGCMovementOffset(MovieObject movieObject)
    {
        //Calculate the delta movement knowing the final / actual position of the ugc after the pinch out
        //Because when the user pinch out and in rapidly it can produce a wrong behaviour allowing more movement outside of the limite
        //This is because the image can be smaller or greater and allow more movement and if we keep that value as DeltaMovement
        //When we calculate the position each frame it will be a greater number so that it's a problem

        var deltaMovement = movieObject.GameObject.transform.localPosition / _ugcMovementSensitivity;

        movieObject.UGCFamily.UserMovement = deltaMovement;
    }

    public void RecalculateUGCDeltaPinch(MovieObject movieObject)
    {
        if (movieObject.IsBeingScaled)
        {
            movieObject.IsBeingScaled = false;

            var deltaPinch = (movieObject.GameObject.transform.localScale.x - movieObject.InitialScale.x) / _ugcScaleSensitivity;

            movieObject.UGCFamily.UserZoomDelta = deltaPinch;
        }
    }

