    public void SetToGlobal(Transform trans, bool bSetScale)
    {
        if (bSetScale)
        {
            trans.localScale = Vector3.one;
            //this simulates what it would be like to set lossyScale considering the way unity treats it
            var m = trans.worldToLocalMatrix;
            m.SetColumn(3, new Vector4(0f, 0f, 0f, 1f));
            trans.localScale = m.MultiplyPoint(Vector3.one);
        }
    }

    Texture2D RotateTextureUsingExif(Texture2D originalTexture, ExifOrientation orientation)
    {
        switch (orientation)
        {
            case ExifOrientation.BottomRight:
                return FlipTexture(originalTexture);
            case ExifOrientation.TopRight:
                return RotateTexture(originalTexture, true);
            case ExifOrientation.BottomLeft:
                return RotateTexture(originalTexture, false);
            default:
                return null;
        }
    }

    Texture2D FlipTexture(Texture2D original)
    {
        Texture2D flipped = new Texture2D(original.width, original.height);

        var pix = original.GetPixels();
        Array.Reverse(pix, 0, pix.Length);

        flipped.SetPixels(pix);
        flipped.Apply();

        return flipped;
    }

    Texture2D RotateTexture(Texture2D originalTexture, bool clockwise)
    {
        Color32[] original = originalTexture.GetPixels32();
        Color32[] rotated = new Color32[original.Length];
        int w = originalTexture.width;
        int h = originalTexture.height;

        int iRotated, iOriginal;

        for (int j = 0; j < h; ++j)
        {
            for (int i = 0; i < w; ++i)
            {
                iRotated = (i + 1) * h - j - 1;
                iOriginal = clockwise ? original.Length - 1 - (j * w + i) : j * w + i;
                rotated[iRotated] = original[iOriginal];
            }
        }

        Texture2D rotatedTexture = new Texture2D(h, w);
        rotatedTexture.SetPixels32(rotated);
        rotatedTexture.Apply();
        return rotatedTexture;
    }

