    IEnumerator ReadJobsFromS3(string url, string receiptHandle)
    {
        UnityWebRequest www = UnityWebRequest.Get(url);

        yield return www.SendWebRequest();

        while (!www.isDone && string.IsNullOrEmpty(www.error))
        {
            yield return null;
        }

        if (string.IsNullOrEmpty(www.error))
        {
            JobReadFromS3Callback(www.downloadHandler.text, receiptHandle);

            Debug.Log("Job Read Done.");
        }
        else
        {
            Debug.Log(www.error);
        }
    }

