            CreateWebGLUGC(index);
            GoToUGCFrame(index);
        }
        else
            GoToUGCFrame(index);

        WebGLFooter.transform.GetChild(3).gameObject.SetActive(index != WebGLTemplates[selctedTemplate].ugc.Count - 1);
        WebGLFooter.transform.GetChild(4).gameObject.SetActive(index == WebGLTemplates[selctedTemplate].ugc.Count - 1);

        if (index >= 1)
            SetBlueCheckActive(index - 1);
    }

    public void GoToUGCFrame(int value)
    {
        if (_currentActiveMO != null)
            _currentActiveMO.MaskGO.SetActive(false);

        ugc = WebGLTemplates[selctedTemplate].ugc[value].id;

        _currentActiveMO = _movieObjects[ugc];

        _currentActiveMO.MaskGO.SetActive(true);

        _currentActiveMO.GameObject.transform.parent.gameObject.SetActive(true);

        _currentTemplateData.UGCDragBackHandler.SetMaskGO(_currentActiveMO.MaskGO);
        _currentTemplateData.UGCDragBackHandler.SetUGCId(_currentActiveMO.Name);
        _currentTemplateData.UGCPinchBackHandler.SetGameObjectToScale(_currentActiveMO.GameObject);

        _currentTemplateData.UGCRootFront.gameObject.SetActive(false);

        for (int i = 0; i < _currentTemplateData.videoFrames.Count; i++)
            _currentTemplateData.videoFrames[i].SetActive(i == value);

        SetZoomSliderValues(0.25f, 4f, _currentActiveMO.UGCFamily.UserZoomDelta);

        replacingText.text = "Replacing Image (" + (value + 1) + "/" + WebGLTemplates[selctedTemplate].ugc.Count + ")";
    }
