    public void SaveJobs()
    {
        LoaderGO.SetActive(true);

        JobMeta jobToSave = new JobMeta();
        jobToSave.ugcs = new List<UGCMetaObject>();
        UGCMetaObject metaObjecttoSave = new UGCMetaObject();

        jobToSave.templateid = WebGLTemplates[selctedTemplate].themeId;

        foreach (var MO in _movieObjects)
        {
            metaObjecttoSave = new UGCMetaObject();

            metaObjecttoSave.id = MO.Key;
            metaObjecttoSave.position = MO.Value.UGCFamily.UserMovement;

            metaObjecttoSave.size = new Size();
            metaObjecttoSave.size.width = MO.Value.GameObject.transform.localScale.x.ToString();
            metaObjecttoSave.size.height = MO.Value.GameObject.transform.localScale.y.ToString();

            byte[] image = converteImageToTexture2D(MO.Value.UIImage.sprite).EncodeToPNG();
            metaObjecttoSave.previewFrame = Convert.ToBase64String(image);

            jobToSave.ugcs.Add(metaObjecttoSave);
        }

        string json = JsonConvert.SerializeObject(jobToSave, new JsonSerializerSettings { ReferenceLoopHandling = ReferenceLoopHandling.Ignore });

        StartCoroutine(SendJsonToAWSLambda("https://p74cadexub.execute-api.us-east-2.amazonaws.com/UnityPOCV1/SaveJob", json));
    }
#endif

    IEnumerator SendJsonToAWSLambda(string url, string json)
    {
        var request = new UnityWebRequest(url, "POST");
        byte[] bodyRaw = Encoding.UTF8.GetBytes(json);
        request.uploadHandler = (UploadHandler)new UploadHandlerRaw(bodyRaw);
        request.downloadHandler = (DownloadHandler)new DownloadHandlerBuffer();
        request.SetRequestHeader("Content-Type", "application/json");
        request.SetRequestHeader("authorizationToken", "allow");

        yield return request.SendWebRequest();


        while (!request.isDone && string.IsNullOrEmpty(request.error))
        {
            yield return null;
        }

        if (string.IsNullOrEmpty(request.error))
        {
            LoaderGO.SetActive(false);
            Debug.Log("Job Send to lambda successfully.");
        }
        else
        {
            Debug.Log(request.error);
        }
    }


    private Texture2D converteImageToTexture2D(Sprite sprite)
    {
        Texture2D croppedTexture = new Texture2D((int)sprite.rect.width, (int)sprite.rect.height);
        Color[] pixels = sprite.texture.GetPixels((int)sprite.rect.x, (int)sprite.rect.y, (int)sprite.rect.width, (int)sprite.rect.height);
        croppedTexture.SetPixels(pixels);
        croppedTexture.Apply();
        return croppedTexture;
    }

