    private void CreateWebGLUGC(int ugcNumber)
    {
        var newMO = new MovieObject();

        var parentDummyGo = new GameObject { name = WebGLTemplates[selctedTemplate].ugc[ugcNumber].id + "_root", layer = 10 };
        var rectTransform = parentDummyGo.AddComponent<RectTransform>();

        rectTransform.transform.SetParent(_currentTemplateData.UGCRootBack.transform);

        var parentFrontGO = new GameObject { name = WebGLTemplates[selctedTemplate].ugc[ugcNumber].id + "_Mask", layer = 10 };
        var rectTransformFrontGO = parentFrontGO.AddComponent<RectTransform>();

        parentFrontGO.transform.SetParent(rectTransform.transform);

        var go = new GameObject
        {
            name = WebGLTemplates[selctedTemplate].ugc[ugcNumber].id,
            layer = 10
        };

        go.AddComponent<RectTransform>();
        newMO.Name = go.name;

        SetParentingData(go, newMO);

        go.transform.SetParent(rectTransformFrontGO.transform);

        newMO.Position = _currentTemplateData.UGCRootBack.transform.position;
        newMO.Scale = new Vector3(1f, 1f, 1f);

        newMO.EulerRotation = new Vector3(WebGLTemplates[selctedTemplate].ugc[ugcNumber].rotation.x, WebGLTemplates[selctedTemplate].ugc[ugcNumber].rotation.y, -WebGLTemplates[selctedTemplate].ugc[ugcNumber].rotation.z);

        newMO.GameObject = go;

        var parentFrontGOImage = parentFrontGO.AddComponent<Image>();
        parentFrontGO.AddComponent<Mask>();

        newMO.MaskGO = parentFrontGO;

        parentFrontGOImage.raycastTarget = false;
        parentFrontGOImage.color = new Color(parentFrontGOImage.color.r, parentFrontGOImage.color.g, parentFrontGOImage.color.b, 0.15f);

        newMO.GameObject.transform.SetParent(rectTransformFrontGO.transform);

        var border = new GameObject { name = "Border", layer = 10 };
        border.transform.SetParent(rectTransformFrontGO.transform);

        var borderImage = border.AddComponent<Image>();
        borderImage.sprite = BorderUGCFront;
        borderImage.raycastTarget = false;
        border.SetActive(false);

        newMO.BorderGO = border;

        rectTransform.anchorMin = Vector2.zero;
        rectTransform.anchorMax = Vector2.one;
        rectTransform.sizeDelta = Vector2.zero;

        LoadWebGLLayer(newMO, ugcNumber);

        newMO.MaskGO.SetActive(true);

        _movieObjects.Add(newMO.Name, newMO);

        SetUGCMovementRadiusLimit(newMO);

        SetUGCFamilies();

        GC.Collect();
    }

    private void LoadWebGLLayer(MovieObject newMO, int index)
    {
        var newGO = newMO.GameObject;

        newMO.UIImage = newGO.AddComponent<Image>();
        newMO.UIImage.enabled = true;
        newMO.UIImage.preserveAspect = false;
        newMO.UIImage.raycastTarget = false;

        if (index % 2 == 0)
            newMO.UIImage.sprite = Base64toSprite(UGCTest_Base64_Andy01);
        else
            newMO.UIImage.sprite = Base64toSprite(UGCTest_Base64_Andy02);

        var parentTransform = newMO.GameObject.GetComponent<RectTransform>();

        var height = float.Parse(WebGLTemplates[selctedTemplate].ugc[index].size.height);
        var width = float.Parse(WebGLTemplates[selctedTemplate].ugc[index].size.width);

        newMO.MaskGO.GetComponent<Mask>().rectTransform.sizeDelta = new Vector2(width, height);

        parentTransform.sizeDelta = new Vector2(width, height);
        var relPosition = TranslateAEPositionToWorld(new Vector3(WebGLTemplates[selctedTemplate].ugc[index].position.x, WebGLTemplates[selctedTemplate].ugc[index].position.y, WebGLTemplates[selctedTemplate].ugc[index].position.z), newMO.GameObject.GetComponent<RectTransform>());

        parentTransform.localScale = Vector3.one;
        parentTransform.localEulerAngles = new Vector3(WebGLTemplates[selctedTemplate].ugc[index].orientation.x, WebGLTemplates[selctedTemplate].ugc[index].orientation.y, -WebGLTemplates[selctedTemplate].ugc[index].orientation.z);

        parentTransform.anchoredPosition3D = new Vector3(relPosition.x, relPosition.y, WebGLTemplates[selctedTemplate].ugc[index].position.z);

        newMO.LocalInitScale = Vector3.one;

        newMO.LocalInitOrientation = Quaternion.identity.eulerAngles;

        newMO.GameObject.transform.localScale = newMO.LocalInitScale;
        newMO.GameObject.transform.rotation = Quaternion.identity;
        newMO.GameObject.transform.position = Vector3.zero;

        _UGCImages.Add(newMO.Name, new UGCObject { UGCImage = newMO.UIImage, PosDelta = Vector3.zero, ScaleDelta = Vector3.one, Position = Vector3.zero, Scale = newMO.UIImage.transform.localScale });
    }
#endif

    private Sprite Base64toSprite(string base64)
    {
        byte[] bytes = Convert.FromBase64String(base64);

        Texture2D tex = new Texture2D(1, 1);

        tex.LoadImage(bytes);

        Sprite spriteAsset = Sprite.Create(tex, new Rect(0.0f, 0.0f, tex.width, tex.height), new Vector2(0f, 0f));

        return spriteAsset;
    }
